Concatenation
à¤¸à¤‚à¤¯à¥‹à¤œà¤¨
Concatenation involves adding two or more strings together, creating a larger string containing the combined data of those original strings.  The concatenation of a string appends one or more strings to another string.  This is done in JavaScript using the following ways.
à¤¸à¤‚à¤¯à¥‹à¤œà¤¨à¤®à¤¾ à¤¦à¥à¤ˆ à¤µà¤¾ à¤¦à¥à¤ˆ à¤­à¤¨à¥à¤¦à¤¾ à¤¬à¤¢à¥€ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤¹à¤°à¥‚ à¤à¤•à¤¸à¤¾à¤¥ à¤¥à¤ªà¥à¤¨à¥ à¤¸à¤®à¤¾à¤µà¥‡à¤¶ à¤›, à¤¤à¥€ à¤®à¥‚à¤² à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤‚à¤¯à¥à¤•à¥à¤¤ à¤¡à¥‡à¤Ÿà¤¾ à¤¸à¤®à¤¾à¤µà¥‡à¤¶ à¤—à¤°à¥à¤¨à¥‡ à¤ à¥‚à¤²à¥‹ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¦à¤›à¥¤  à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤•à¥‹ à¤¸à¤‚à¤¯à¥‹à¤œà¤¨à¤²à¥‡ à¤à¤• à¤µà¤¾ à¤à¤•à¤­à¤¨à¥à¤¦à¤¾ à¤¬à¤¢à¥€ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤²à¤¾à¤ˆ à¤…à¤°à¥à¤•à¥‹ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤®à¤¾ à¤œà¥‹à¤¡à¥à¤¦à¤›à¥¤  à¤¯à¥‹ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤®à¤¾ à¤¨à¤¿à¤®à¥à¤¨ à¤¤à¤°à¤¿à¤•à¤¾à¤¹à¤°à¥‚ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤

using the  + operator
'+' à¤…à¤ªà¤°à¥‡à¤Ÿà¤° à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¥ˆ
using the concat() method
concat() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¥ˆ
using the array join() method
à¤¸à¤°à¤£à¥€ join() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¥ˆ
using the template literal (introduced in ES6)
à¤Ÿà¥‡à¤®à¥à¤ªà¥à¤²à¥‡à¤Ÿ à¤¶à¤¾à¤¬à¥à¤¦à¤¿à¤• à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¥ˆ (à¤ˆà¤à¤¸ 6 à¤®à¤¾ à¤ªà¥à¤°à¤¸à¥à¤¤à¥à¤¤)

The string concat() method accepts the list of strings as parameters and returns a new string after concatenation i.e. combination of all the strings. Whereas the array join() method is used to concatenate all the elements present in an array by converting them into a single string.
à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™ concat() à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤•à¥‹ à¤¸à¥‚à¤šà¥€à¤²à¤¾à¤ˆ à¤ªà¥à¤¯à¤¾à¤°à¤¾à¤®à¤¿à¤Ÿà¤°à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤¸à¥à¤µà¥€à¤•à¤¾à¤° à¤—à¤°à¥à¤¦à¤› à¤° à¤¸à¤‚à¤¯à¥‹à¤œà¤¨ à¤ªà¤›à¤¿ à¤¨à¤¯à¤¾à¤ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤› à¤…à¤°à¥à¤¥à¤¾à¤¤à¥ à¤¸à¤¬à¥ˆ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤‚à¤¯à¥‹à¤œà¤¨à¥¤ à¤œà¤¬à¤•à¤¿ à¤à¤°à¥‡ join() à¤µà¤¿à¤§à¤¿ à¤à¤°à¥‡à¤®à¤¾ à¤‰à¤ªà¤¸à¥à¤¥à¤¿à¤¤ à¤¸à¤¬à¥ˆ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚à¤²à¤¾à¤ˆ à¤à¤•à¤² à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥‡à¤° à¤¸à¤‚à¤¯à¥‹à¤œà¤¨ à¤—à¤°à¥à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤
The template literal  uses backtick (``) and provides an easy way to create multiline strings and perform string interpolation. An expression can be used inside the backtick using $ sign and curly braces $(expression}.
à¤Ÿà¥‡à¤®à¥à¤ªà¥à¤²à¥‡à¤Ÿ à¤¶à¤¾à¤¬à¥à¤¦à¤¿à¤• à¤°à¥‚à¤ªà¤®à¤¾ à¤¬à¥à¤¯à¤¾à¤•à¤Ÿà¤¿à¤• (``) à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¤› à¤° à¤®à¤²à¥à¤Ÿà¤¿à¤²à¤¾à¤‡à¤¨ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤¹à¤°à¥‚ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤° à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™ à¤‡à¤¨à¥à¤Ÿà¤°à¤ªà¥‹à¤²à¥‡à¤¸à¤¨ à¤ªà¥à¤°à¤¦à¤°à¥à¤¶à¤¨ à¤—à¤°à¥à¤¨ à¤¸à¤œà¤¿à¤²à¥‹ à¤¤à¤°à¤¿à¤•à¤¾ à¤ªà¥à¤°à¤¦à¤¾à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤$à¤šà¤¿à¤¨à¥à¤¹ à¤° à¤˜à¥à¤‚à¤˜à¤°à¤¾à¤²à¥‡ à¤¬à¥à¤°à¥‡à¤¸à¥‡à¤¸$(à¤…à¤­à¤¿à¤µà¥à¤¯à¤•à¥à¤¤à¤¿} à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¬à¥à¤¯à¤¾à¤•à¤Ÿà¤¿à¤• à¤­à¤¿à¤¤à¥à¤° à¤…à¤­à¤¿à¤µà¥à¤¯à¤•à¥à¤¤à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤
