arrays/push.html.body:
Push
à¤ªà¥à¤¶
One can push certain items to an array making the last index the newly added item. It changes the length of an array and returns a new length.
à¤…à¤¨à¥à¤¤à¤¿à¤® à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾à¤²à¤¾à¤ˆ à¤¨à¤¯à¤¾à¤ à¤¥à¤ªà¤¿à¤à¤•à¥‹ à¤µà¤¸à¥à¤¤à¥ à¤¬à¤¨à¤¾à¤‰à¤¨à¥‡ à¤¸à¤°à¤£à¥€à¤®à¤¾ à¤¨à¤¿à¤¶à¥à¤šà¤¿à¤¤ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤§à¤•à¥‡à¤²à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤ à¤¯à¤¸à¤²à¥‡ à¤à¤°à¥‡à¤•à¥‹ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¦à¤› à¤° à¤¨à¤¯à¤¾à¤ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤
Here's the syntax for using push:
à¤¯à¤¹à¤¾à¤ 'à¤ªà¥à¤¶' à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤›:
array.push(element1[, ...[, elementN]]);

The element1, ..., elementN arguments represent the elements to be added to the end of the array.
element1, ..., elementN à¤¤à¤°à¥à¤•à¤¹à¤°à¥‚à¤²à¥‡ à¤à¤°à¥‡à¤•à¥‹ à¤…à¤¨à¥à¤¤à¥à¤¯à¤®à¤¾ à¤¥à¤ªà¤¿à¤¨à¥‡ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚à¤•à¥‹ à¤ªà¥à¤°à¤¤à¤¿à¤¨à¤¿à¤§à¤¿à¤¤à¥à¤µ à¤—à¤°à¥à¤¦à¤›à¥¤
For example:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤•à¥‹ à¤²à¤¾à¤—à¥€:
let array = [1, 2, 3]; 
array.push(4); 

console.log(array); 

// Result: array = [1, 2, 3, 4]

You can also use push to add elements to the end of an array-like object (such as an arguments object or a NodeList object) by first converting it to an array using the Array.prototype.slice() method:
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤à¤°à¥‡ à¤œà¤¸à¥à¤¤à¥‹ à¤µà¤¸à¥à¤¤à¥ (à¤œà¤¸à¥à¤¤à¥ˆ à¤¤à¤°à¥à¤• à¤µà¤¸à¥à¤¤à¥ à¤µà¤¾ à¤¨à¥‹à¤¡à¤²à¤¿à¤¸à¥à¤Ÿ à¤µà¤¸à¥à¤¤à¥) à¤•à¥‹ à¤…à¤¨à¥à¤¤à¥à¤¯à¤®à¤¾ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤¥à¤ªà¥à¤¨ push à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›, à¤¯à¤¸à¤²à¤¾à¤ˆ Array.prototype.slice() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¸à¤°à¤£à¥€à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥‡à¤°:
function printArguments() {
  let args = Array.prototype.slice.call(arguments);
  args.push('d', 'e', 'f');
  console.log(args);
}

printArguments('a', 'b', 'c'); // Result: ["a", "b", "c", "d", "e", "f"]

  Note that the push method modifies the original array. It does not create a new array.
à¤¨à¥‹à¤Ÿ à¤—à¤°à¥à¤¨à¥à¤¹à¥‹à¤¸à¥ à¤•à¤¿ à¤ªà¥à¤¶ à¤µà¤¿à¤§à¤¿ à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤®à¥‚à¤² à¤à¤°à¥à¤°à¥‡ à¤ªà¤°à¤¿à¤®à¤¾à¤°à¥à¤œà¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¸à¤²à¥‡ à¤¨à¤¯à¤¾à¤ à¤à¤°à¥‡ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¦à¥ˆà¤¨à¥¤

arrays/indices.html.body:
Indices
à¤¸à¥‚à¤šà¤•à¤¾à¤‚à¤•
So you have your array of data elements, but what if you want to access a specific element? That is where indices come in. An index refers to a spot in the array. indices logically progress one by one, but it should be noted that the first index in an array is 0, as it is in most languages. Brackets [] are used to signify you are referring to an index of an array.
à¤¤à¤ªà¤¾à¤‡à¤à¤¸à¤à¤— à¤¡à¥‡à¤Ÿà¤¾ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚à¤•à¥‹ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤•à¥‹ à¤à¤°à¥‡ à¤›, à¤¤à¤° à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤à¤• à¤µà¤¿à¤¶à¤¿à¤·à¥à¤Ÿ à¤¤à¤¤à¥à¤µ à¤ªà¤¹à¥à¤à¤š à¤—à¤°à¥à¤¨ à¤šà¤¾à¤¹à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤­à¤¨à¥‡ à¤•à¥‡ à¤¹à¥à¤¨à¥à¤›? à¤¯à¤¹à¥€à¤à¤¬à¤¾à¤Ÿ à¤‡à¤¨à¥à¤¡à¥‡à¤•à¥à¤¸ à¤†à¤‰à¤à¤› à¥¤ à¤à¤• à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾ à¤²à¥‡ à¤¸à¤°à¤£à¥€à¤®à¤¾ à¤à¤• à¤¸à¥à¤¥à¤¾à¤¨à¤²à¤¾à¤ˆ à¤¬à¥à¤à¤¾à¤‰à¤à¤›à¥¤ à¤¸à¥‚à¤šà¤•à¤¾à¤‚à¤•à¤¹à¤°à¥‚ à¤¤à¤¾à¤°à¥à¤•à¤¿à¤• à¤°à¥‚à¤ªà¤®à¤¾ à¤à¤•-à¤à¤• à¤—à¤°à¥‡à¤° à¤ªà¥à¤°à¤—à¤¤à¤¿ à¤—à¤°à¥à¤›à¤¨à¥, à¤¤à¤° à¤¯à¥‹ à¤§à¥à¤¯à¤¾à¤¨ à¤¦à¤¿à¤¨à¥à¤ªà¤°à¥à¤¦à¤› à¤•à¤¿ à¤à¤°à¥‡à¤®à¤¾ à¤ªà¤¹à¤¿à¤²à¥‹ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾ à¥¦ à¤¹à¥‹, à¤•à¤¿à¤¨à¤•à¤¿ à¤¯à¥‹ à¤…à¤§à¤¿à¤•à¤¾à¤‚à¤¶ à¤­à¤¾à¤·à¤¾à¤¹à¤°à¥‚à¤®à¤¾ à¤›à¥¤ à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤¸à¤°à¤£à¥€à¤•à¥‹ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾à¤²à¤¾à¤ˆ à¤¸à¤™à¥à¤•à¥‡à¤¤ à¤—à¤°à¥à¤¦à¥ˆ à¤¹à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤­à¤¨à¥à¤¨à¥‡ à¤¸à¤™à¥à¤•à¥‡à¤¤ à¤—à¤°à¥à¤¨ à¤•à¥‹à¤·à¥à¤ à¤• [] à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤› à¥¤
// This is an array of strings
let fruits = ["apple", "banana", "pineapple", "strawberry"];

// We set the variable banana to the value of the second element of
// the fruits array. Remember that indices start at 0, so 1 is the
// second element. Result: banana = "banana"
let banana = fruits[1];

You can also use an array index to set the value of an element in an array:
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤¸à¤°à¤£à¥€à¤®à¤¾ à¤¤à¤¤à¥à¤µà¤•à¥‹ à¤®à¤¾à¤¨ à¤¸à¥‡à¤Ÿ à¤—à¤°à¥à¤¨ à¤¸à¤°à¤£à¥€ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¥¤
let array = ['a', 'b', 'c', 'd', 'e'];
//  indices:  0    1    2    3    4
array[4] = 'f';
console.log(array); // Result: ['a', 'b', 'c', 'd', 'f']

Note that if you try to access or set an element using an index that is outside the bounds of the array (i.e., an index that is less than 0 or greater than or equal to the length of the array), you will get an undefined value.
à¤¯à¤¾à¤¦ à¤—à¤°à¥à¤¨à¥à¤¹à¥‹à¤¸à¥ à¤•à¤¿ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤¸à¤°à¤£à¥€à¤•à¥‹ à¤¸à¥€à¤®à¤¾ à¤­à¤¨à¥à¤¦à¤¾ à¤¬à¤¾à¤¹à¤¿à¤°à¤•à¥‹ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¤à¤¤à¥à¤µ à¤ªà¤¹à¥à¤à¤š à¤—à¤°à¥à¤¨ à¤µà¤¾ à¤¸à¥‡à¤Ÿ à¤—à¤°à¥à¤¨ à¤ªà¥à¤°à¤¯à¤¾à¤¸ à¤—à¤°à¥à¤¨à¥à¤­à¤¯à¥‹ à¤­à¤¨à¥‡ (à¤œà¤¸à¥à¤¤à¥ˆ, à¥¦ à¤­à¤¨à¥à¤¦à¤¾ à¤•à¤® à¤µà¤¾ à¤¸à¤°à¤£à¥€à¤•à¥‹ à¤²à¤®à¥à¤¬à¤¾à¤‡à¤­à¤¨à¥à¤¦à¤¾ à¤¬à¤¢à¥€ à¤µà¤¾ à¤¬à¤°à¤¾à¤¬à¤° à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾), à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤…à¤ªà¤°à¤¿à¤­à¤¾à¤·à¤¿à¤¤ à¤®à¤¾à¤¨ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¨à¥à¤¹à¥à¤¨à¥‡à¤›à¥¤
console.log(array[5]); // Output: undefined
array[5] = 'g';
console.log(array); // Result: ['a', 'b', 'c', 'd', 'f', undefined, 'g']

