Loops
Loops are repetitive conditions where one variable in the loop changes. Loops are handy, if you want to run the same code over and over again, each time with a different value.
à¤²à¥‚à¤ªà¤¹à¤°à¥‚ à¤¦à¥‹à¤¹à¥‹à¤°à¤¿à¤¨à¥‡ à¤…à¤µà¤¸à¥à¤¥à¤¾à¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥ à¤œà¤¹à¤¾à¤ à¤²à¥‚à¤ªà¤®à¤¾ à¤à¤• à¤šà¤° à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤¹à¥à¤¨à¥à¤›à¥¤ à¤²à¥à¤ªà¤¹à¤°à¥‚ à¤¸à¤œà¤¿à¤²à¥‹ à¤›à¤¨à¥, à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤à¤‰à¤Ÿà¥ˆ à¤•à¥‹à¤¡ à¤ªà¤Ÿà¤•-à¤ªà¤Ÿà¤• à¤šà¤²à¤¾à¤‰à¤¨ à¤šà¤¾à¤¹à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤­à¤¨à¥‡, à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤ªà¤Ÿà¤• à¤«à¤°à¤• à¤®à¤¾à¤¨à¤•à¥‹ à¤¸à¤¾à¤¥à¥¤
Instead of writing:
