loops/for.html.body:
For
The easiest form of a loop is the for statement. This one has a syntax that is similar to an if statement, but with more options:
à¤²à¥à¤ªà¤•à¥‹ à¤¸à¤¬ à¤­à¤¨à¥à¤¦à¤¾ à¤¸à¤œà¤¿à¤²à¥‹ à¤°à¥‚à¤ª à¤«à¤° à¤¹à¥‹à¥¤ 
for (condition; end condition; change) {
    // do it, do it now
}

Let's see how to execute the same code ten-times using a for loop:
 à¤¹à¤¾à¤®à¥€à¤²à¥‡ à¤«à¤° à¤²à¥‚à¤ª à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¦à¤¸ à¤ªà¤Ÿà¤• à¤à¤‰à¤Ÿà¥ˆ à¤•à¥‹à¤¡ à¤•à¤¸à¤°à¥€ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤›à¥Œ, à¤¹à¥‡à¤°à¥Œà¤‚ à¥¤
for (let i = 0; i 

Note: i = i + 1 can be written i++.
à¤¨à¥‹à¤Ÿ:  i = i + 1 à¤²à¤¾à¤—à¤¿ à¤¯à¤¸à¤°à¤¿ à¤²à¥‡à¤–à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤› i++à¥¤

To loop through the properties of an object or an array for in loop can also be used.
à¤à¤• à¤µà¤¸à¥à¤¤à¥ à¤µà¤¾ à¤à¤°à¥‡ à¤«à¤° à¤‡à¤¨  à¤²à¥‚à¤ªà¤•à¥‹ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤®à¤¾à¤°à¥à¤«à¤¤ à¤²à¥‚à¤ª à¤—à¤°à¥à¤¨ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤
for (key in object) {
  // code block to be executed
}

Examples of for in loop for an object and array is shown below:
à¤µà¤¸à¥à¤¤à¥ à¤° à¤à¤°à¥‡à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤«à¤° à¤‡à¤¨` à¤²à¥‚à¤ªà¤•à¤¾ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤¹à¤°à¥‚ à¤¤à¤² à¤¦à¥‡à¤–à¤¾à¤‡à¤à¤•à¥‹ à¤›à¥¤
const person = {fname:"John", lname:"Doe", age:25};
let info = "";
for (let x in person) {
  info += person[x];
}

// Result: info = "JohnDoe25"

const numbers = [45, 4, 9, 16, 25];
let txt = "";
for (let x in numbers) {
  txt += numbers[x];
}

// Result: txt = '45491625'

The value of iterable objects such as Arrays, Strings, Maps, NodeLists can be looped using for of statement.
à¤ªà¥à¤¨à¤°à¤¾à¤µà¥ƒà¤¤à¥à¤¤à¤¿ à¤¯à¥‹à¤—à¥à¤¯ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚à¤•à¥‹ à¤®à¤¾à¤¨ à¤œà¤¸à¥à¤¤à¥ˆ à¤à¤°à¥‡, à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¥à¤¸, à¤®à¥à¤¯à¤¾à¤ªà¥à¤¸, à¤¨à¥‹à¤¡à¤²à¤¿à¤¸à¥à¤Ÿà¥à¤¸ à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤•à¤¥à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤²à¥à¤ª à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤
let language = "JavaScript";
