loops/dowhile.html.body:
Do...While
à¤¡à¥ ... à¤µà¤¹à¤¾à¤‡à¤²
The do...while statement creates a loop that executes a specified statement until the test condition evaluates to be false. The condition is evaluated after executing the statement. The syntax for do... while is
à¤¡à¥ ... à¤µà¤¹à¤¾à¤‡à¤² à¤•à¤¥à¤¨à¤²à¥‡ à¤²à¥‚à¤ª à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¦à¤› à¥¤ à¤¯à¤¸à¤²à¥‡ à¤¤à¤¬à¤¸à¤®à¥à¤® à¤¨à¤¿à¤°à¥à¤¦à¤¿à¤·à¥à¤Ÿ à¤•à¤¥à¤¨ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¤› à¤œà¤¬à¤¸à¤®à¥à¤® à¤ªà¤°à¥€à¤•à¥à¤·à¤£ à¤…à¤µà¤¸à¥à¤¥à¤¾ à¤—à¤²à¤¤ à¤¹à¥à¤¨ à¤•à¥‹ à¤²à¤¾à¤—à¥€ à¤®à¥‚à¤²à¥à¤¯à¤¾à¤‚à¤•à¤¨ à¤—à¤°à¥à¤¦à¥ˆà¤¨à¥¤ à¤¬à¤¯à¤¾à¤¨ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤ªà¤›à¤¿ à¤…à¤µà¤¸à¥à¤¥à¤¾ à¤®à¥‚à¤²à¥à¤¯à¤¾à¤‚à¤•à¤¨ à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤
do {
  // statement
} while (expression);

Lets for example see how to print numbers less than 10 using do...while loop:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤¹à¥‡à¤°à¥Œà¤‚ à¤•à¤¸à¤°à¥€ à¥§à¥¦ à¤­à¤¨à¥à¤¦à¤¾ à¤•à¤® à¤¨à¤®à¥à¤¬à¤°à¤¹à¤°à¥‚ à¤®à¥à¤¦à¥à¤°à¤£ à¤—à¤°à¥à¤¨à¥‡ à¥¤
var i = 0;
do {
  document.write(i + " ");
  i++; // incrementing i by 1
} while (i 

Note: i = i + 1 can be written i++.

functions/higher-order.html.body:
Higher order
à¤‰à¤šà¥à¤š à¤…à¤°à¥à¤¡à¤°
Higher order functions are functions that manipulate other functions. For example, a function can take other functions as arguments and/or produce a function as its return value. Such fancy functional techniques are powerful constructs available to you in JavaScript and other high-level languages like python, lisp, etc.
"à¤‰à¤šà¥à¤š à¤•à¥à¤°à¤® à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚" à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥ à¤œà¥à¤¨ à¤…à¤¨à¥à¤¯ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¹à¥‡à¤°à¤«à¥‡à¤° à¤—à¤°à¥à¤¦à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿, à¤à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤²à¥‡ à¤…à¤¨à¥à¤¯ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¤à¤°à¥à¤•à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤²à¤¿à¤¨ à¤¸à¤•à¥à¤› à¤° / à¤µà¤¾ à¤¯à¤¸à¤•à¥‹ à¤°à¤¿à¤Ÿà¤°à¥à¤¨ à¤®à¤¾à¤¨à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤‰à¤¤à¥à¤ªà¤¾à¤¦à¤¨ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤›à¥¤ à¤¯à¤¸à¥à¤¤à¥‹ fancy à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¤à¥à¤®à¤• à¤ªà¥à¤°à¤µà¤¿à¤§à¤¿à¤¹à¤°à¥‚ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿ à¤° à¤…à¤¨à¥à¤¯ à¤‰à¤šà¥à¤š-à¤¸à¥à¤¤à¤°à¥€à¤¯ à¤­à¤¾à¤·à¤¾à¤¹à¤°à¥‚ à¤œà¤¸à¥à¤¤à¥ˆ à¤ªà¤¾à¤‡à¤¥à¤¨, à¤²à¤¿à¤¸à¥à¤ª, à¤†à¤¦à¤¿à¤®à¤¾ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤‰à¤ªà¤²à¤¬à¥à¤§ à¤¶à¤•à¥à¤¤à¤¿à¤¶à¤¾à¤²à¥€ à¤¸à¤‚à¤°à¤šà¤¨à¤¾à¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥à¥¤
We will now create two simple functions, add_2 and double, and a higher order function called map. map will accept two arguments, func and list (its declaration will therefore begin map(func,list)), and return an array. func (the first argument) will be a function that will be applied to each of the elements in the array list (the second argument).
à¤…à¤¬ à¤¹à¤¾à¤®à¥€ à¤¦à¥à¤ˆ à¤¸à¤°à¤² à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨à¥‡à¤›à¥Œà¤‚, add_2 à¤° add_2, à¤° map à¤­à¤¨à¤¿à¤¨à¥‡ à¤à¤• à¤‰à¤šà¥à¤š à¤•à¥à¤°à¤® à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¥¤ map à¤²à¥‡ à¤¦à¥à¤ˆ à¤¤à¤°à¥à¤•à¤¹à¤°à¥‚ à¤¸à¥à¤µà¥€à¤•à¤¾à¤° à¤—à¤°à¥à¤¦à¤›, func à¤° list (à¤¯à¤¸à¤•à¥‹ à¤˜à¥‹à¤·à¤£à¤¾à¤²à¥‡ à¤¯à¤¸à¥ˆà¤²à¥‡ map(func,list) à¤¸à¥à¤°à¥ à¤—à¤°à¥à¤¨à¥‡à¤›), à¤° à¤à¤• à¤à¤°à¥‡ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤ func (à¤ªà¤¹à¤¿à¤²à¥‹ à¤¤à¤°à¥à¤•) à¤à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¹à¥à¤¨à¥‡à¤› à¤œà¥à¤¨ à¤à¤°à¥‡ list (à¤¦à¥‹à¤¸à¥à¤°à¥‹ à¤¤à¤°à¥à¤•) à¤®à¤¾ à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤¤à¤¤à¥à¤µà¤®à¤¾ à¤²à¤¾à¤—à¥‚ à¤¹à¥à¤¨à¥‡à¤›à¥¤
// Define two simple functions
let add_2 = function (x) {
  return x + 2;
};
let double = function (x) {
  return 2 * x;
};

// map is cool function that accepts 2 arguments:
//  func    the function to call
//  list    a array of values to call func on
let map = function (func, list) {
  let output = []; // output list
  for (idx in list) {
    output.push(func(list[idx]));
  }
  return output;
};

// We use map to apply a function to an entire list
// of inputs to "map" them to a list of corresponding outputs
map(add_2, [5, 6, 7]); // => [7, 8, 9]
map(double, [5, 6, 7]); // => [10, 12, 14]

The functions in the above example are simple. However, when passed as arguments to other functions, they can be composed in unforeseen ways to build more complex functions.
à¤®à¤¾à¤¥à¤¿à¤•à¥‹ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤®à¤¾ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¸à¤°à¤² à¤›à¤¨à¥à¥¤ à¤¤à¤¥à¤¾à¤ªà¤¿, à¤œà¤¬ à¤…à¤¨à¥à¤¯ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚à¤®à¤¾ à¤¤à¤°à¥à¤•à¤¹à¤°à¥‚à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤ªà¤¾à¤°à¤¿à¤¤ à¤—à¤°à¤¿à¤¨à¥à¤›, à¤¤à¤¿à¤¨à¥€à¤¹à¤°à¥‚à¤²à¤¾à¤ˆ à¤…à¤§à¤¿à¤• à¤œà¤Ÿà¤¿à¤² à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¨à¤¿à¤°à¥à¤®à¤¾à¤£ à¤—à¤°à¥à¤¨ à¤…à¤ªà¥à¤°à¤¤à¥à¤¯à¤¾à¤¶à¤¿à¤¤ à¤¤à¤°à¤¿à¤•à¤¾à¤®à¤¾ à¤°à¤šà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤
For example, if we notice that we use the invocations map(add_2, ...) and map(double, ...) very often in our code, we could decide we want to create two special-purpose list processing functions that have the desired operation baked into them. Using function composition, we could do this as follows:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿, à¤¯à¤¦à¤¿ à¤¹à¤¾à¤®à¥€ à¤§à¥à¤¯à¤¾à¤¨ à¤¦à¤¿à¤¨à¥à¤›à¥Œà¤‚ à¤•à¤¿ à¤¹à¤¾à¤®à¥€ à¤†à¤¹à¥à¤µà¤¾à¤¨à¤¹à¤°à¥‚ map(add_2, ...) à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¤›à¥Œà¤‚à¥¤ à¤° map(double, ...) à¤ªà¥à¤°à¤¾à¤¯ à¤¹à¤¾à¤®à¥à¤°à¥‹ à¤•à¥‹à¤¡à¤®à¤¾, à¤¹à¤¾à¤®à¥€ à¤¨à¤¿à¤°à¥à¤£à¤¯ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤›à¥Œà¤‚ à¤•à¤¿ à¤¹à¤¾à¤®à¥€ à¤¦à¥à¤ˆ à¤µà¤¿à¤¶à¥‡à¤·-à¤‰à¤¦à¥à¤¦à¥‡à¤¶à¥à¤¯ à¤¸à¥‚à¤šà¥€ à¤ªà¥à¤°à¥‹à¤¸à¥‡à¤¸à¤¿à¤‚à¤— à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤šà¤¾à¤¹à¤¨à¥à¤›à¥Œà¤‚ à¤œà¥à¤¨ à¤¤à¤¿à¤¨à¥€à¤¹à¤°à¥‚à¤®à¤¾ à¤‡à¤šà¥à¤›à¤¿à¤¤ à¤…à¤ªà¤°à¥‡à¤¶à¤¨ à¤¬à¥‡à¤• à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥¤ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¸à¤‚à¤°à¤šà¤¨à¤¾ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤°, à¤¹à¤¾à¤®à¥€ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤¨à¤¿à¤®à¥à¤¨à¤¾à¤¨à¥à¤¸à¤¾à¤° à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤›à¥Œà¤‚:
process_add_2 = function (list) {
  return map(add_2, list);
};
process_double = function (list) {
  return map(double, list);
};
process_add_2([5, 6, 7]); // => [7, 8, 9]
process_double([5, 6, 7]); // => [10, 12, 14]

Now let's create a function called buildProcessor that takes a function func as input and returns a func-processor, that is, a function that applies func to each input in list.
à¤…à¤¬ buildProcessor à¤¨à¤¾à¤®à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥Œà¤‚ à¤œà¤¸à¤²à¥‡ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ func à¤²à¤¾à¤ˆ à¤‡à¤¨à¤ªà¥à¤Ÿà¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤²à¤¿à¤¨à¥à¤› à¤° func -à¤ªà¥à¤°à¥‹à¤¸à¥‡à¤¸à¤° à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›, à¤…à¤°à¥à¤¥à¤¾à¤¤à¥, à¤à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤œà¤¸à¤²à¥‡ à¤¸à¥‚à¤šà¥€à¤®à¤¾ à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤‡à¤¨à¤ªà¥à¤Ÿà¤®à¤¾ func à¤²à¤¾à¤—à¥‚ à¤—à¤°à¥à¤¦à¤›à¥¤
// a function that generates a list processor that performs
let buildProcessor = function (func) {
  let process_func = function (list) {
    return map(func, list);
  };
  return process_func;
};
// calling buildProcessor returns a function which is called with a list input

// using buildProcessor we could generate the add_2 and double list processors as follows:
process_add_2 = buildProcessor(add_2);
process_double = buildProcessor(double);

process_add_2([5, 6, 7]); // => [7, 8, 9]
process_double([5, 6, 7]); // => [10, 12, 14]

Let's look at another example. We'll create a function called buildMultiplier that takes a number x as input and returns a function that multiplies its argument by x :
à¤…à¤°à¥à¤•à¥‹ à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¹à¥‡à¤°à¥Œà¤‚à¥¤ à¤¹à¤¾à¤®à¥€ buildMultiplier à¤¨à¤¾à¤®à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨à¥‡à¤›à¥Œà¤‚ à¤œà¤¸à¤²à¥‡ à¤¸à¤‚à¤–à¥à¤¯à¤¾ x à¤²à¤¾à¤ˆ à¤‡à¤¨à¤ªà¥à¤Ÿà¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤²à¤¿à¤¨à¥à¤› à¤° à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤› à¤œà¤¸à¤²à¥‡ à¤¯à¤¸à¤•à¥‹ à¤¤à¤°à¥à¤•à¤²à¤¾à¤ˆ x à¤²à¥‡ à¤—à¥à¤£à¤¾ à¤—à¤°à¥à¤¦à¤›:
let buildMultiplier = function (x) {
  return function (y) {
    return x * y;
  };
};

let double = buildMultiplier(2);
let triple = buildMultiplier(3);

double(3); // => 6
triple(3); // => 9

objects/properties.html.body:
Properties
à¤—à¥à¤£à¤¹à¤°à¥‚
Object's property is a propertyName: propertyValue pair, where property name can be only a string. If it's not a string, it gets casted into a string. You can specify properties when creating an object or later. There may be zero or more properties separated by commas.
à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤ªà¥à¤°à¥‹à¤ªà¤°à¥à¤Ÿà¥€ propertyName à¤¹à¥‹: propertyValue à¤œà¥‹à¤¡à¥€, à¤œà¤¹à¤¾à¤ à¤—à¥à¤£ à¤¨à¤¾à¤® à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™ à¤®à¤¾à¤¤à¥à¤° à¤¹à¥à¤¨ à¤¸à¤•à¥à¤› à¥¤ à¤¯à¤¦à¤¿ à¤¯à¥‹ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™ à¤¹à¥‹à¤‡à¤¨ à¤­à¤¨à¥‡, à¤¯à¥‹ à¤à¤• à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤‚à¤—à¤®à¤¾ à¤«à¥à¤¯à¤¾à¤à¤•à¤¿à¤¨à¥à¤›à¥¤ à¤µà¤¸à¥à¤¤à¥ à¤µà¤¾ à¤ªà¤›à¤¿ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¦à¤¾ à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤—à¥à¤£ à¤¨à¤¿à¤°à¥à¤¦à¤¿à¤·à¥à¤Ÿ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¥¤ à¤…à¤²à¥à¤ªà¤µà¤¿à¤°à¤¾à¤®à¤¦à¥à¤µà¤¾à¤°à¤¾ à¤›à¥à¤Ÿà¥à¤¯à¤¾à¤‡à¤à¤•à¥‹ à¤¶à¥‚à¤¨à¥à¤¯ à¤µà¤¾ à¤¬à¤¢à¥€ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤¹à¥à¤¨ à¤¸à¤•à¥à¤›à¤¨à¥à¥¤
let language = {
  name: "JavaScript",
  isSupportedByBrowsers: true,
  createdIn: 1995,
  author: {
    firstName: "Brendan",
    lastName: "Eich",
  },
  // Yes, objects can be nested!
  getAuthorFullName: function () {
    return this.author.firstName + " " + this.author.lastName;
  },
  // Yes, functions can be values too!
};

The following code demonstrates how to get a property's value.
à¤¨à¤¿à¤®à¥à¤¨ à¤•à¥‹à¤¡à¤²à¥‡ à¤•à¤¸à¤°à¥€ à¤¸à¤®à¥à¤ªà¤¤à¥à¤¤à¤¿à¤•à¥‹ à¤®à¥‚à¤²à¥à¤¯ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¨à¥‡ à¤­à¤¨à¥‡à¤° à¤¦à¥‡à¤–à¤¾à¤‰à¤à¤›à¥¤
let variable = language.name;
// variable now contains "JavaScript" string.
variable = language["name"];
// The lines above do the same thing. The difference is that the second one lets you use litteraly any string as a property name, but it's less readable.
variable = language.newProperty;
// variable is now undefined, because we have not assigned this property yet.

The following example shows how to add a new property or change an existing one.
à¤¨à¤¿à¤®à¥à¤¨ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤²à¥‡ à¤•à¤¸à¤°à¥€ à¤¨à¤¯à¤¾à¤ à¤—à¥à¤£ à¤¥à¤ªà¥à¤¨à¥‡ à¤µà¤¾ à¤…à¤µà¤¸à¥à¤¥à¤¿à¤¤ à¤—à¥à¤£ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¨à¥‡ à¤­à¤¨à¥‡à¤° à¤¦à¥‡à¤–à¤¾à¤‰à¤à¤›à¥¤
language.newProperty = "new value";
// Now the object has a new property. If the property already exists, its value will be replaced.
language["newProperty"] = "changed value";
// Once again, you can access properties both ways. The first one (dot notation) is recomended.

objects/prototype.html.body:
Prototype
à¤ªà¥à¤°à¥‹à¤Ÿà¥‹à¤Ÿà¤¾à¤‡à¤ª
Every object is linked to a prototype object from which it inherits properties.
à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤µà¤¸à¥à¤¤à¥ à¤à¤• à¤ªà¥à¤°à¥‹à¤Ÿà¥‹à¤Ÿà¤¾à¤‡à¤ª à¤µà¤¸à¥à¤¤à¥à¤¸à¤à¤— à¤œà¥‹à¤¡à¤¿à¤à¤•à¥‹ à¤› à¤œà¤¸à¤¬à¤¾à¤Ÿ à¤¯à¤¸à¤²à¥‡ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¦à¤›à¥¤
All objects created from object literals ({}) are automatically linked to Object.prototype, which is an object that comes standard with JavaScript.
à¤µà¤¸à¥à¤¤à¥ à¤¶à¤¾à¤¬à¥à¤¦à¤¿à¤• ({}) à¤¬à¤¾à¤Ÿ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¤¿à¤à¤•à¤¾ à¤¸à¤¬à¥ˆ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤¸à¥à¤µà¤šà¤¾à¤²à¤¿à¤¤ à¤°à¥‚à¤ªà¤®à¤¾ Object.prototype à¤¸à¤à¤— à¤²à¤¿à¤™à¥à¤• à¤¹à¥à¤¨à¥à¤›à¤¨à¥, à¤œà¥à¤¨ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤•à¥‹ à¤¸à¤¾à¤¥ à¤®à¤¾à¤¨à¤• à¤†à¤‰à¤¨à¥‡ à¤µà¤¸à¥à¤¤à¥ à¤¹à¥‹à¥¤
When a JavaScript interpreter (a module in your browser) tries to find a property, which You want to retrieve, like in the following code:
à¤œà¤¬ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿ à¤¦à¥à¤­à¤¾à¤·à¤¿à¤¯à¤¾ (à¤¤à¤ªà¤¾à¤ˆà¤‚à¤•à¥‹ à¤¬à¥à¤°à¤¾à¤‰à¤œà¤°à¤®à¤¾ à¤à¤• à¤®à¥‹à¤¡à¥à¤¯à¥à¤²) à¤²à¥‡ à¤à¤‰à¤Ÿà¤¾ à¤—à¥à¤£ à¤«à¥‡à¤²à¤¾ à¤ªà¤¾à¤°à¥à¤¨à¥‡ à¤ªà¥à¤°à¤¯à¤¾à¤¸ à¤—à¤°à¥à¤¦à¤›, à¤œà¥à¤¨ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤ªà¥à¤¨: à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¨ à¤šà¤¾à¤¹à¤¨à¥à¤¹à¥à¤¨à¥à¤›, à¤œà¤¸à¥à¤¤à¥ˆ à¤¨à¤¿à¤®à¥à¤¨ à¤•à¥‹à¤¡à¤®à¤¾:
let adult = { age: 26 },
  retrievedProperty = adult.age;
// The line above

First, the interpreter looks through every property the object itself has. For example, adult has only one own property â€” age. But besides that one, it actually has a few more properties, which were inherited from Object.prototype.
à¤ªà¤¹à¤¿à¤²à¥‹, à¤¦à¥à¤­à¤¾à¤·à¤¿à¤¯à¤¾à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤¸à¤à¤— à¤­à¤à¤•à¤¾ à¤¹à¤°à¥‡à¤• à¤¸à¤®à¥à¤ªà¤¤à¥à¤¤à¤¿à¤²à¤¾à¤ˆ à¤¹à¥‡à¤°à¥à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿, adult à¤•à¥‹ à¤†à¤«à¥à¤¨à¥ˆ à¤¸à¤®à¥à¤ªà¤¤à¥à¤¤à¤¿ à¤›- ageà¥¤ à¤¤à¤° à¤¤à¥à¤¯à¥‹ à¤¬à¤¾à¤¹à¥‡à¤•, à¤¯à¤¸à¤®à¤¾ à¤µà¤¾à¤¸à¥à¤¤à¤µà¤®à¤¾ à¤•à¥‡à¤¹à¤¿ à¤…à¤¨à¥à¤¯ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤›à¤¨à¥, à¤œà¥à¤¨ Object.prototype à¤¬à¤¾à¤Ÿ à¤µà¤¿à¤°à¤¾à¤¸à¤¤à¤®à¤¾ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤­à¤à¤•à¥‹ à¤¥à¤¿à¤¯à¥‹à¥¤
let stringRepresentation = adult.toString();
// the variable has value of '[object Object]'

toString is an Object.prototype's property, which was inherited. It has a value of a function, which returns a string representation of the object. If you want it to return a more meaningful representation, then you can override it. Simply add a new property to the adult object.
toString à¤à¤• Object.prototype's à¤ªà¥à¤°à¥‹à¤ªà¤°à¥à¤Ÿà¥€ à¤¹à¥‹, à¤œà¥à¤¨ à¤µà¤¿à¤°à¤¾à¤¸à¤¤à¤®à¤¾ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤­à¤à¤•à¥‹ à¤¥à¤¿à¤¯à¥‹à¥¤ à¤¯à¤¸à¤®à¤¾ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤•à¥‹ à¤®à¤¾à¤¨ à¤›, à¤œà¤¸à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™ à¤ªà¥à¤°à¤¤à¤¿à¤¨à¤¿à¤§à¤¿à¤¤à¥à¤µ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤…à¤ à¤…à¤°à¥à¤¥à¤ªà¥‚à¤°à¥à¤£ à¤ªà¥à¤°à¤¤à¤¿à¤¨à¤¿à¤§à¤¿à¤¤à¥à¤µ à¤«à¤¿à¤°à¥à¤¤à¤¾ à¤—à¤°à¥à¤¨ à¤šà¤¾à¤¹à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤­à¤¨à¥‡, à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤“à¤­à¤°à¤°à¤¾à¤‡à¤¡ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›à¥¤ à¤¬à¤¸ à¤µà¤¯à¤¸à¥à¤• à¤µà¤¸à¥à¤¤à¥à¤®à¤¾ à¤¨à¤¯à¤¾à¤ à¤—à¥à¤£ à¤¥à¤ªà¥à¤¨à¥à¤¹à¥‹à¤¸à¥à¥¤
adult.toString = function () {
  return "I'm " + this.age;
