objects/enumeration.html.body:
Enumeration
à¤—à¤£à¤¨à¤¾[à¤¸à¤®à¥à¤ªà¤¾à¤¦à¤¨ à¤—à¤°à¥à¤¨à¥‡]
Enumeration refers to the process of iterating over the properties of an object and performing a certain action for each property. There are several ways to enumerate the properties of an object in JavaScript.
à¤—à¤£à¤¨à¤¾à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤®à¤¾à¤¥à¤¿ à¤ªà¥à¤¨à¤°à¤¾à¤µà¥ƒà¤¤à¥à¤¤à¤¿ à¤—à¤°à¥à¤¨à¥‡ à¤° à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤—à¥à¤£à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤¨à¤¿à¤¶à¥à¤šà¤¿à¤¤ à¤•à¤¾à¤°à¥à¤¯ à¤—à¤°à¥à¤¨à¥‡ à¤ªà¥à¤°à¤•à¥à¤°à¤¿à¤¯à¤¾à¤²à¤¾à¤ˆ à¤¬à¥à¤à¤¾à¤‰à¤à¤›à¥¤ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤®à¤¾ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤—à¤£à¤¨à¤¾ à¤—à¤°à¥à¤¨à¥‡ à¤§à¥‡à¤°à¥ˆ à¤¤à¤°à¤¿à¤•à¤¾à¤¹à¤°à¥‚ à¤›à¤¨à¥à¥¤
One way to enumerate the properties of an object is to use the for-in loop. The for-in loop iterates over the enumerable properties of an object in an arbitrary order, and for each property it executes a given block of code.
à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤—à¤£à¤¨à¤¾ à¤—à¤°à¥à¤¨à¥‡ à¤à¤‰à¤Ÿà¤¾ à¤¤à¤°à¤¿à¤•à¤¾ à¤­à¤¨à¥‡à¤•à¥‹ 'à¤«à¥‹à¤°-à¤‡à¤¨' à¤²à¥‚à¤ª à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¥ à¤¹à¥‹à¥¤ 'à¤«à¤°-à¤‡à¤¨' à¤²à¥‚à¤ªà¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤—à¤£à¤¨à¤¾ à¤¯à¥‹à¤—à¥à¤¯ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤®à¤¾à¤¥à¤¿ à¤¸à¥à¤µà¥‡à¤šà¥à¤›à¤¾à¤šà¤¾à¤°à¥€ à¤•à¥à¤°à¤®à¤®à¤¾ à¤ªà¥à¤¨à¤°à¤¾à¤µà¥ƒà¤¤à¥à¤¤à¤¿ à¤—à¤°à¥à¤¦à¤›, à¤° à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤—à¥à¤£à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤¯à¤¸à¤²à¥‡ à¤•à¥‹à¤¡à¤•à¥‹ à¤¦à¤¿à¤‡à¤à¤•à¥‹ à¤¬à¥à¤²à¤• à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤
The for in statement can loop over all of the property names in an object. The enumeration will include functions and prototype properties.
'à¤«à¥‹à¤°-à¤‡à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿' à¤•à¤¥à¤¨à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤®à¤¾ à¤¸à¤¬à¥ˆ à¤¸à¤®à¥à¤ªà¤¤à¥à¤¤à¤¿ à¤¨à¤¾à¤®à¤¹à¤°à¥‚ à¤²à¥à¤ª à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤›à¥¤ à¤—à¤£à¤¨à¤¾à¤®à¤¾ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤° à¤ªà¥à¤°à¥‹à¤Ÿà¥‹à¤Ÿà¤¾à¤‡à¤ª à¤—à¥à¤£à¤¹à¤°à¥‚ à¤¸à¤®à¤¾à¤µà¥‡à¤¶ à¤¹à¥à¤¨à¥‡à¤›à¤¨à¥à¥¤
let fruit = {
    apple: 2,
    orange: 5,
    pear: 1,
  },
  sentence = "I have ",
  quantity;
for (kind in fruit) {
  quantity = fruit[kind];
  sentence += quantity + " " + kind + (quantity === 1 ? "" : "s") + ", ";
}
// The following line removes the trailing comma.
sentence = sentence.substr(0, sentence.length - 2) + ".";
// I have 2 apples, 5 oranges, 1 pear.

Another way to enumerate the properties of an object is to use the Object.keys() method, which returns an array of the object's own enumerable property names.
à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤—à¤£à¤¨à¤¾ à¤—à¤°à¥à¤¨à¥‡ à¤…à¤°à¥à¤•à¥‹ à¤¤à¤°à¤¿à¤•à¤¾ Object.keys() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¥ à¤¹à¥‹, à¤œà¤¸à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤†à¤«à¥à¤¨à¥ˆ à¤—à¤£à¤¨à¤¾ à¤¯à¥‹à¤—à¥à¤¯ à¤—à¥à¤£ à¤¨à¤¾à¤®à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤°à¤£à¥€ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤
For example:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¥‹ à¤²à¤¾à¤—à¥€:
let object = {
  foo: 'bar',
  baz: 'qux'
};

let properties = Object.keys(object);
properties.forEach(function(property) {
  console.log(property + ': ' + object[property]);
});

// foo: bar
// baz: qux

