Access Modifiers
à¤ªà¤¹à¥à¤à¤š à¤ªà¤°à¤¿à¤®à¤¾à¤°à¥à¤œà¤¨à¤•à¤°à¥à¤¤à¤¾à¤¹à¤°à¥‚
public, private, and protected are the three access modifiers used in class to control its access from the outside. By default, all members (properties, fields, methods, or functions) are publicly accessible from outside the class.
public, private, à¤° protected  à¤¤à¥€à¤¨ à¤ªà¤¹à¥à¤à¤š à¤ªà¤°à¤¿à¤®à¤¾à¤°à¥à¤œà¤•à¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥ à¤œà¥à¤¨ à¤•à¤•à¥à¤·à¤¾à¤®à¤¾ à¤¬à¤¾à¤¹à¤¿à¤°à¤¬à¤¾à¤Ÿ à¤¯à¤¸à¤•à¥‹ à¤ªà¤¹à¥à¤à¤š à¤¨à¤¿à¤¯à¤¨à¥à¤¤à¥à¤°à¤£ à¤—à¤°à¥à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤ à¤ªà¥‚à¤°à¥à¤µà¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤¿à¤¤ à¤°à¥‚à¤ªà¤®à¤¾, à¤¸à¤¬à¥ˆ à¤¸à¤¦à¤¸à¥à¤¯à¤¹à¤°à¥‚ (à¤—à¥à¤£à¤¹à¤°à¥‚, à¤•à¥à¤·à¥‡à¤¤à¥à¤°à¤¹à¤°à¥‚, à¤µà¤¿à¤§à¤¿à¤¹à¤°à¥‚, à¤µà¤¾ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚) à¤µà¤°à¥à¤— à¤¬à¤¾à¤¹à¤¿à¤°à¤¬à¤¾à¤Ÿ à¤¸à¤¾à¤°à¥à¤µà¤œà¤¨à¤¿à¤• à¤°à¥‚à¤ªà¤®à¤¾ à¤ªà¤¹à¥à¤à¤š à¤¯à¥‹à¤—à¥à¤¯ à¤›à¤¨à¥à¥¤
class Car {
  constructor(name) {
    this.name = name;
  }
  static hello(x) {
    return "Hello " + x.name;
  }
}
let myCar = new Car("Toyota");
console.log(Car.hello(myCar)); // Hello Toyota

private  members can access only internally within the class and cannot be accessible from outside.  Private should start with #.
private à¤¸à¤¦à¤¸à¥à¤¯à¤¹à¤°à¥‚à¤²à¥‡ à¤•à¤•à¥à¤·à¤¾à¤­à¤¿à¤¤à¥à¤° à¤®à¤¾à¤¤à¥à¤° à¤†à¤¨à¥à¤¤à¤°à¤¿à¤• à¤°à¥‚à¤ªà¤®à¤¾ à¤ªà¤¹à¥à¤à¤š à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¦à¤›à¤¨à¥ à¤° à¤¬à¤¾à¤¹à¤¿à¤°à¤¬à¤¾à¤Ÿ à¤ªà¤¹à¥à¤à¤š à¤¯à¥‹à¤—à¥à¤¯ à¤¹à¥à¤¨ à¤¸à¤•à¥à¤¦à¥ˆà¤¨à¤¨à¥à¥¤  à¤ªà¥à¤°à¤¾à¤‡à¤­à¥‡à¤Ÿ # à¤¬à¤¾à¤Ÿ à¤¸à¥à¤°à¥ à¤—à¤°à¥à¤¨à¥à¤ªà¤°à¥à¤› à¥¤
class Car {
  constructor(name) {
    this.name = name;
  }
  static hello(x) {
    return "Hello " + x.name;
  }
  #present(carname) {
    return 'I have a ' + this.carname;
  }
}
let myCar = new Car("Toyota");
console.log(myCar.#present("Camry")); // Error
console.log(Car.hello(myCar)); // Hello Toyota

protected fields are accessible only from inside the class and those extending it. These are useful for the internal interface as the inheriting class also gains access to the parent class.  Protected fields with _ .
protected à¤•à¥à¤·à¥‡à¤¤à¥à¤°à¤¹à¤°à¥‚ à¤µà¤°à¥à¤— à¤­à¤¿à¤¤à¥à¤° à¤° à¤¯à¤¸à¤²à¤¾à¤ˆ à¤µà¤¿à¤¸à¥à¤¤à¤¾à¤° à¤—à¤°à¥à¤¨à¥‡à¤¹à¤°à¥‚à¤¬à¤¾à¤Ÿ à¤®à¤¾à¤¤à¥à¤° à¤ªà¤¹à¥à¤à¤šà¤¯à¥‹à¤—à¥à¤¯ à¤›à¤¨à¥à¥¤ à¤¯à¥€ à¤†à¤¨à¥à¤¤à¤°à¤¿à¤• à¤‡à¤¨à¥à¤Ÿà¤°à¤«à¥‡à¤¸à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤‰à¤ªà¤¯à¥‹à¤—à¥€ à¤›à¤¨à¥ à¤•à¤¿à¤¨à¤•à¤¿ à¤‰à¤¤à¥à¤¤à¤°à¤¾à¤§à¤¿à¤•à¤¾à¤°à¥€ à¤µà¤°à¥à¤—à¤²à¥‡ à¤…à¤­à¤¿à¤­à¤¾à¤µà¤• à¤µà¤°à¥à¤—à¤®à¤¾ à¤ªà¤¨à¤¿ à¤ªà¤¹à¥à¤à¤š à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¦à¤›à¥¤  _ à¤¸à¤à¤— à¤¸à¤‚à¤°à¤•à¥à¤·à¤¿à¤¤ à¤«à¤¾à¤à¤Ÿà¤¹à¤°à¥‚ à¥¤
class Car {
  constructor(brand) {
    this.carname = brand;
  }
  _present() {
    return 'I have a ' + this.carname;
  }
}

class Model extends Car {
  constructor(brand, mod) {
    super(brand);
    this.model = mod;
  }
  show() {
    return this._present() + ', it is a ' + this.model;
  }
}

let myCar = new Model("Toyota", "Camry");
console.log(myCar.show()) // I have a Toyota, it is a Camry

