Popup
à¤ªà¤ªà¤…à¤ª
Popups are an additional way to show information, take user confirmation, or take user input from additional documents. A popup can navigate to a new URL and send information to the opener window. Alert box, Confirmation box,  and Prompt box are the global functions where we can show the popup information.
à¤ªà¤ªà¤…à¤ªà¤¹à¤°à¥‚ à¤œà¤¾à¤¨à¤•à¤¾à¤°à¥€ à¤¦à¥‡à¤–à¤¾à¤‰à¤¨, à¤ªà¥à¤°à¤¯à¥‹à¤—à¤•à¤°à¥à¤¤à¤¾ à¤ªà¥à¤·à¥à¤Ÿà¤¿à¤•à¤°à¤£ à¤²à¤¿à¤¨, à¤µà¤¾ à¤¥à¤ª à¤•à¤¾à¤—à¤œà¤¾à¤¤à¤¹à¤°à¥‚à¤¬à¤¾à¤Ÿ à¤ªà¥à¤°à¤¯à¥‹à¤—à¤•à¤°à¥à¤¤à¤¾ à¤‡à¤¨à¤ªà¥à¤Ÿ à¤²à¤¿à¤¨à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤à¤• à¤…à¤¤à¤¿à¤°à¤¿à¤•à¥à¤¤ à¤¤à¤°à¤¿à¤•à¤¾ à¤¹à¥‹à¥¤ à¤ªà¤ªà¤…à¤ªà¤²à¥‡ à¤¨à¤¯à¤¾à¤ à¤¯à¥‚à¤†à¤°à¤à¤²à¤®à¤¾ à¤¨à¥‡à¤­à¤¿à¤—à¥‡à¤Ÿ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¦à¤› à¤° à¤“à¤ªà¤¨à¤° à¤¸à¤žà¥à¤à¥à¤¯à¤¾à¤²à¤®à¤¾ à¤¸à¥‚à¤šà¤¨à¤¾ à¤ªà¤ à¤¾à¤‰à¤¨ à¤¸à¤•à¥à¤›à¥¤ à¤šà¥‡à¤¤à¤¾à¤µà¤¨à¥€ à¤¬à¤¾à¤•à¤¸, à¤ªà¥à¤·à¥à¤Ÿà¤¿ à¤¬à¤¾à¤•à¤¸, à¤° à¤ªà¥à¤°à¥‰à¤®à¥à¤ªà¥à¤Ÿ à¤¬à¤•à¥à¤¸ à¤µà¤¿à¤¶à¥à¤µà¤µà¥à¤¯à¤¾à¤ªà¥€ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥ à¤œà¤¹à¤¾à¤ à¤¹à¤¾à¤®à¥€ à¤ªà¤ªà¤…à¤ª à¤œà¤¾à¤¨à¤•à¤¾à¤°à¥€ à¤¦à¥‡à¤–à¤¾à¤‰à¤¨ à¤¸à¤•à¥à¤›à¥Œà¤‚à¥¤

alert(): It displays information to the user and has an  "OK" button to proceed.
 à¤¯à¤¸à¤²à¥‡ à¤ªà¥à¤°à¤¯à¥‹à¤—à¤•à¤°à¥à¤¤à¤¾à¤²à¤¾à¤ˆ à¤œà¤¾à¤¨à¤•à¤¾à¤°à¥€ à¤ªà¥à¤°à¤¦à¤°à¥à¤¶à¤¿à¤¤ à¤—à¤°à¥à¤¦à¤› à¤° à¤…à¤—à¤¾à¤¡à¤¿ à¤¬à¤¢à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ "OK" à¤¬à¤Ÿà¤¨ à¤›à¥¤
