miscellaneous/hoisting.html.body:
Hoisting
à¤¹à¥‹à¤‡à¤¸à¥à¤Ÿà¤¿à¤‚à¤—
Hosting is a default behavior in JavaScript of moving declarations at the top.  While executing a code, it creates a global execution context:  creation and execution.  In the creation phase, JavaScript moves the variable and function declaration to the top of the page, which is known as hoisting. 
à¤¹à¥‹à¤¸à¥à¤Ÿà¤¿à¤™ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤®à¤¾ à¤ªà¥‚à¤°à¥à¤µà¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤¿à¤¤ à¤µà¥à¤¯à¤µà¤¹à¤¾à¤° à¤¹à¥‹ à¤œà¥à¤¨ à¤¶à¥€à¤°à¥à¤·à¤®à¤¾ à¤˜à¥‹à¤·à¤£à¤¾à¤¹à¤°à¥‚ à¤¸à¤¾à¤°à¥à¤¨à¥‡ à¤›à¥¤  à¤à¤• à¤•à¥‹à¤¡ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¤¾, à¤¯à¤¸à¤²à¥‡ à¤µà¤¿à¤¶à¥à¤µà¤µà¥à¤¯à¤¾à¤ªà¥€ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¦à¤›: à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤° à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨à¥¤  à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤šà¤°à¤£à¤®à¤¾, à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤²à¥‡ à¤šà¤° à¤° à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤˜à¥‹à¤·à¤£à¤¾à¤²à¤¾à¤ˆ à¤ªà¥ƒà¤·à¥à¤ à¤•à¥‹ à¤¶à¥€à¤°à¥à¤·à¤®à¤¾ à¤¸à¤¾à¤°à¥à¤¦à¤›, à¤œà¥à¤¨ à¤‰à¤¤à¥à¤¥à¤¾à¤¨à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤šà¤¿à¤¨à¤¿à¤¨à¥à¤›à¥¤
// variable hoisting
console.log(counter);
let counter = 1; // throws ReferenceError: Cannot access 'counter' before initialization

Although the counter is present in the heap memory but hasn't been initialized so, it throws an error. This happens because of hoisting, the counter variable is hoisted here. 
à¤¯à¤¦à¥à¤¯à¤ªà¤¿ 'à¤•à¤¾à¤‰à¤¨à¥à¤Ÿà¤°' à¤¢à¥‡à¤° à¤®à¥‡à¤®à¥‹à¤°à¥€à¤®à¤¾ à¤…à¤µà¤¸à¥à¤¥à¤¿à¤¤ à¤› à¤¤à¤° à¤¸à¥à¤°à¥ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥ˆà¤¨, à¤¯à¤¸à¤²à¥‡ à¤¤à¥à¤°à¥à¤Ÿà¤¿ à¤«à¥à¤¯à¤¾à¤à¤•à¥à¤›à¥¤ à¤¯à¥‹ à¤«à¤¹à¤°à¤¾à¤‰à¤¨à¥‡ à¤•à¤¾à¤°à¤£ à¤¹à¥à¤¨à¥à¤›, 'à¤•à¤¾à¤‰à¤¨à¥à¤Ÿà¤°' à¤šà¤° à¤¯à¤¹à¤¾à¤ à¤«à¤¹à¤°à¤¾à¤‡à¤¨à¥à¤›à¥¤;
// function hoisting
const x = 20,
    y = 10;

let result = add(x,y); // âŒ Uncaught ReferenceError: add is not defined
console.log(result);

let add = (x, y) => x + y;


Here, the add function is hoisted and initialized with undefined in heap memory in the creation phase of the global execution context. Thus, throwing an error. 
à¤¯à¤¹à¤¾à¤, add à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¨à¤¿à¤¸à¥à¤•à¤¿à¤¯à¥‹ à¤° à¤µà¤¿à¤¸à¥à¤¤à¥ƒà¤¤ à¤œà¤¾à¤¨à¤•à¤¾à¤°à¥€à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾` à¤…à¤ªà¤°à¤¿à¤­à¤¾à¤‡à¤¨à¤•à¥‹ à¤¸à¤¾à¤¥ à¤†à¤°à¤®à¥à¤­ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥¤ à¤¯à¤¸à¥ˆà¤²à¥‡, à¤¤à¥à¤°à¥à¤Ÿà¤¿ à¤«à¥à¤¯à¤¾à¤à¤•à¥à¤¦à¥ˆà¥¤

template-literals/currying.html.body:
Currying
à¤•à¤°à¤¿à¤™
Currying is an advanced technique in functional programming of transforming a function with multiple arguments into a sequence of nesting functions. It transforms a function from callable  f(a,b,c) into callable as f(a)(b)(c). It doesnâ€™t call a function instead it transforms it.
'à¤•à¤°à¤¿à¤™' à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¤à¥à¤®à¤• à¤ªà¥à¤°à¥‹à¤—à¥à¤°à¤¾à¤®à¤¿à¤‚à¤—à¤®à¤¾ à¤à¤• à¤‰à¤¨à¥à¤¨à¤¤ à¤ªà¥à¤°à¤µà¤¿à¤§à¤¿ à¤¹à¥‹ à¤œà¥à¤¨ à¤§à¥‡à¤°à¥ˆ à¤¤à¤°à¥à¤•à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤¾à¤¥ à¤à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤²à¤¾à¤ˆ à¤¨à¥‡à¤¸à¥à¤Ÿà¤¿à¤‚à¤— à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚à¤•à¥‹ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¸à¤²à¥‡ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤²à¤¾à¤ˆ f(a,b,c) à¤¬à¤¾à¤Ÿ f(a)(b)(c) à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤•à¤² à¤—à¤°à¥à¤¨ à¤¯à¥‹à¤—à¥à¤¯à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¸à¤²à¥‡ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤²à¤¾à¤ˆ à¤•à¤² à¤—à¤°à¥à¤¦à¥ˆà¤¨ à¤¬à¤°à¥ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¦à¤›à¥¤
To get a better understanding of currying letâ€™s create a simple add function add that takes three arguments and returns the sum of them. Then, we create a addCurry function that takes a single input and returns a series of functions with its sum.
à¤•à¤°à¤¿à¤™à¤•à¥‹ à¤°à¤¾à¤®à¥à¤°à¥‹ à¤¸à¤®à¤ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¨ à¤à¤• à¤¸à¤¾à¤§à¤¾à¤°à¤£ add à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¥à¤ªà¥à¤¨à¥à¤¹à¥‹à¤¸à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥Œà¤‚ à¤œà¥à¤¨ à¤¤à¥€à¤¨ à¤¤à¤°à¥à¤•à¤¹à¤°à¥‚ à¤²à¤¿à¤¨à¥à¤› à¤° à¤¤à¤¿à¤¨à¥€à¤¹à¤°à¥‚à¤•à¥‹ à¤¯à¥‹à¤—à¤«à¤² à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤ à¤¤à¥à¤¯à¤¸à¤ªà¤›à¤¿, à¤¹à¤¾à¤®à¥€ à¤à¤• addCurry à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¦à¤›à¥Œà¤‚ à¤œà¤¸à¤²à¥‡ à¤à¤•à¤² à¤‡à¤¨à¤ªà¥à¤Ÿ à¤²à¤¿à¤¨à¥à¤› à¤° à¤¯à¤¸à¤•à¥‹ à¤¯à¥‹à¤—à¤«à¤²à¤•à¥‹ à¤¸à¤¾à¤¥ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚à¤•à¥‹ à¤¶à¥à¤°à¥ƒà¤‚à¤–à¤²à¤¾ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤
// Noncurried version
const add = (a, b, c)=>{
    return a+ b + c
}
console.log(add(2, 3, 5)) // 10

// Curried version
const addCurry = (a) => {
    return (b)=>{
        return (c)=>{
            return a+b+c
        }
    }
}
console.log(addCurry(2)(3)(5)) // 10

Here, we can see that both the curried and noncurried versions returned the same result. Currying can be beneficial for many reasons, some of which are mentioned here.
à¤¯à¤¹à¤¾à¤, à¤¹à¤¾à¤®à¥€ à¤¦à¥‡à¤–à¥à¤¨ à¤¸à¤•à¥à¤›à¥Œà¤‚ à¤•à¤¿ à¤¦à¥à¤µà¥ˆ à¤•à¤°à¥€à¤¡ à¤° à¤—à¥ˆà¤°-à¤•à¤°à¥€ à¤¸à¤‚à¤¸à¥à¤•à¤°à¤£à¤¹à¤°à¥‚à¤²à¥‡ à¤¸à¤®à¤¾à¤¨ à¤ªà¤°à¤¿à¤£à¤¾à¤® à¤«à¤°à¥à¤•à¤¾à¤à¥¤ à¤•à¤°à¥€ à¤—à¤°à¥à¤¨à¥ à¤§à¥‡à¤°à¥ˆ à¤•à¤¾à¤°à¤£à¤¹à¤°à¥‚à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤²à¤¾à¤­à¤¦à¤¾à¤¯à¤• à¤¹à¥à¤¨ à¤¸à¤•à¥à¤›, à¤œà¤¸à¤®à¤§à¥à¤¯à¥‡ à¤•à¥‡à¤¹à¥€ à¤¯à¤¹à¤¾à¤ à¤‰à¤²à¥à¤²à¥‡à¤– à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥¤

It helps to avoid passing the same variable again and again.(à¤¯à¤¸à¤²à¥‡ à¤à¤‰à¤Ÿà¥ˆ à¤šà¤°à¤²à¤¾à¤ˆ à¤¬à¤¾à¤°à¤®à¥à¤¬à¤¾à¤° à¤ªà¤¾à¤¸ à¤—à¤°à¥à¤¨à¤¬à¤¾à¤Ÿ à¤œà¥‹à¤—à¤¿à¤¨ à¤®à¤¦à¥à¤¦à¤¤ à¤—à¤°à¥à¤¦à¤›à¥¤)

It divides the function into smaller chunks with a single responsibility, making the function less error-prone.(à¤¯à¤¸à¤²à¥‡ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤²à¤¾à¤ˆ à¤à¤•à¤² à¤œà¤¿à¤®à¥à¤®à¥‡à¤µà¤¾à¤°à¥€à¤•à¥‹ à¤¸à¤¾à¤¥ à¤¸à¤¾à¤¨à¥‹ à¤–à¤£à¥à¤¡à¤¹à¤°à¥‚à¤®à¤¾ à¤µà¤¿à¤­à¤¾à¤œà¤¨ à¤—à¤°à¥à¤¦à¤›, à¤œà¤¸à¤²à¥‡ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤²à¤¾à¤ˆ à¤•à¤® à¤¤à¥à¤°à¥à¤Ÿà¤¿-à¤ªà¥à¤°à¤µà¤£ à¤¬à¤¨à¤¾à¤‰à¤à¤¦à¤›à¥¤)

It is used in functional programming to create a high-order function.(à¤¯à¥‹ à¤à¤• à¤‰à¤šà¥à¤š-à¤•à¥à¤°à¤® à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¤à¥à¤®à¤• à¤ªà¥à¤°à¥‹à¤—à¥à¤°à¤¾à¤®à¤¿à¤‚à¤—à¤®à¤¾ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤)

template-literals/linked-list/add.html.body:
Add
à¤œà¥‹à¤¡à¥à¤¨à¥
The add method is created here to add value to a linked list.
à¤²à¤¿à¤™à¥à¤• à¤—à¤°à¤¿à¤à¤•à¥‹ à¤¸à¥‚à¤šà¥€à¤®à¤¾ à¤®à¤¾à¤¨ à¤¥à¤ªà¥à¤¨ à¤¯à¤¹à¤¾à¤ add à¤µà¤¿à¤§à¤¿ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤› à¥¤
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    append = (value) => {
        const newNode = new Node(value) 
        let current = this.head 
        if (!this.head) {
            this.head = newNode 
            return 
        }
        while (current.next) {
            current = current.next
        }
        current.next = newNode
    }
}

template-literals/linked-list/pop.html.body:
Pop
à¤ªà¤ª
Here, a pop method is created to remove a value from the linked list.
à¤¯à¤¹à¤¾à¤, à¤²à¤¿à¤™à¥à¤• à¤—à¤°à¤¿à¤à¤•à¥‹ à¤¸à¥‚à¤šà¥€à¤¬à¤¾à¤Ÿ à¤®à¤¾à¤¨ à¤¹à¤Ÿà¤¾à¤‰à¤¨ 'à¤ªà¤ª' à¤µà¤¿à¤§à¤¿ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥¤
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    pop = () => {
        let current = this.head 
        while (current.next.next) {
            current = current.next 
        }
        current.next = current.next.next 
    }
}

template-literals/linked-list/prepend.ht.body:
Prepend
à¤ªà¥à¤°à¤¿à¤ªà¥‡à¤¨à¥à¤¡
Here, a prepend method is created to add a value before the first child of the linked list.
à¤¯à¤¹à¤¾à¤, à¤²à¤¿à¤™à¥à¤• à¤—à¤°à¤¿à¤à¤•à¥‹ à¤¸à¥‚à¤šà¥€à¤•à¥‹ à¤ªà¤¹à¤¿à¤²à¥‹ à¤¬à¤šà¥à¤šà¤¾ à¤­à¤¨à¥à¤¦à¤¾ à¤ªà¤¹à¤¿à¤²à¥‡ à¤®à¤¾à¤¨ à¤¥à¤ªà¥à¤¨ 'à¤ªà¥à¤°à¤¿à¤ªà¥‡à¤¨à¥à¤¡' à¤µà¤¿à¤§à¤¿ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥¤
class Node {
    constructor(data) {
        this.data = data
        this.next = null 
    }
}

class LinkedList {
    constructor(head) {
        this.head = head 
    }
    prepend = (value) => {
        const newNode = new Node(value)
        if (!this.head) {
            this.head = newNode 
        }
        else {
            newNode.next = this.head 
            this.head = newNode 
        }
    }
}

