Here, the shift method is created to remove the first element of the Linked List.
à¤¯à¤¹à¤¾à¤, à¤²à¤¿à¤™à¥à¤• à¤—à¤°à¤¿à¤à¤•à¥‹ à¤¸à¥‚à¤šà¥€à¤•à¥‹ à¤ªà¤¹à¤¿à¤²à¥‹ à¤¤à¤¤à¥à¤µ à¤¹à¤Ÿà¤¾à¤‰à¤¨ 'à¤¸à¤¿à¤«à¥à¤Ÿ' à¤µà¤¿à¤§à¤¿ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥¤
