template-literals/global-footprint.html.body:
Global footprint
à¤—à¥à¤²à¥‹à¤¬à¤² à¤ªà¤¦à¤šà¤¿à¤¹à¥à¤¨
If you are developing a module, which might be running on a web page, which also runs other modules, then you must beware  of the variable name overlapping.
à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤®à¥‹à¤¡à¥à¤¯à¥à¤² à¤µà¤¿à¤•à¤¾à¤¸ à¤—à¤°à¥à¤¦à¥ˆ à¤¹à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›, à¤œà¥à¤¨ à¤µà¥‡à¤¬ à¤ªà¥ƒà¤·à¥à¤ à¤®à¤¾ à¤šà¤²à¤¿à¤°à¤¹à¥‡à¤•à¥‹ à¤¹à¥à¤¨ à¤¸à¤•à¥à¤›, à¤œà¤¸à¤²à¥‡ à¤…à¤¨à¥à¤¯ à¤®à¥‹à¤¡à¥à¤¯à¥à¤²à¤¹à¤°à¥‚ à¤ªà¤¨à¤¿ à¤šà¤²à¤¾à¤‰à¤à¤¦à¤›, à¤¤à¥à¤¯à¤¸à¤ªà¤›à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¥‡ à¤šà¤° à¤¨à¤¾à¤® à¤“à¤­à¤°à¤²à¥à¤¯à¤¾à¤ªà¤¿à¤™à¤•à¥‹ à¤¬à¤¾à¤°à¥‡à¤®à¤¾ à¤¸à¤¾à¤µà¤§à¤¾à¤¨ à¤¹à¥à¤¨à¥à¤ªà¤°à¥à¤¦à¤›à¥¤
Suppose we are developing a counter module:
à¤®à¤¾à¤¨à¥Œà¤‚ à¤¹à¤¾à¤®à¥€ à¤•à¤¾à¤‰à¤¨à¥à¤Ÿà¤° à¤®à¥‹à¤¡à¥à¤¯à¥à¤² à¤µà¤¿à¤•à¤¾à¤¸ à¤—à¤°à¥à¤¦à¥ˆà¤›à¥Œà¤‚:
let myCounter = {
  number: 0,
  plusPlus: function () {
    this.number = this.number + 1;
  },
  isGreaterThanTen: function () {
    return this.number > 10;
  },
