basics/variables.html.body:
Variables
The first step towards really understanding programming is looking back at algebra. If you remember it from school, algebra starts with writing terms such as the following.
à¤µà¤¾à¤¸à¥à¤¤à¤µà¤®à¤¾ à¤ªà¥à¤°à¥‹à¤—à¥à¤°à¤¾à¤®à¤¿à¤‚à¤— à¤¬à¥à¤à¥à¤¨à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤ªà¤¹à¤¿à¤²à¥‹ à¤•à¤¦à¤® à¤¬à¥€à¤œà¤—à¤£à¤¿à¤¤à¤®à¤¾ à¤«à¤°à¥à¤•à¥‡à¤° à¤¹à¥‡à¤°à¥à¤¨à¥ à¤¹à¥‹à¥¤ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤¸à¥à¤•à¥‚à¤²à¤¬à¤¾à¤Ÿ à¤¸à¤®à¥à¤à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤­à¤¨à¥‡, à¤¬à¥€à¤œà¤—à¤£à¤¿à¤¤ à¤¨à¤¿à¤®à¥à¤¨ à¤œà¤¸à¥à¤¤à¤¾ à¤¶à¤¬à¥à¤¦à¤¹à¤°à¥‚ à¤²à¥‡à¤–à¥à¤¦à¥ˆ à¤¸à¥à¤°à¥ à¤¹à¥à¤¨à¥à¤›à¥¤
3 + 5 = 8
You start performing calculations when you introduce an unknown, for example, x below:
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤…à¤œà¥à¤žà¤¾à¤¤ à¤ªà¤°à¤¿à¤šà¤¯ à¤¦à¤¿à¤‚à¤¦à¤¾ à¤—à¤£à¤¨à¤¾ à¤¹à¤°à¥‚ à¤—à¤°à¥à¤¨ à¤¥à¤¾à¤²à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›, à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿, à¤¤à¤² à¤à¤•à¥à¤¸:
3 + x = 8
Shifting those around you can determine x:
à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤µà¤°à¤¿à¤ªà¤°à¤¿ à¤¤à¥€ à¤¸à¥à¤¥à¤¾à¤¨à¤¾à¤¨à¥à¤¤à¤°à¤£ à¤à¤•à¥à¤¸ à¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤£ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›:
x = 8 - 3
-> x = 5
When you introduce more than one you make your terms more flexible - you are using variables:
à¤œà¤¬ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤à¤• à¤­à¤¨à¥à¤¦à¤¾ à¤¬à¤¢à¥€ à¤ªà¤°à¤¿à¤šà¤¯ à¤¦à¤¿à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤†à¤«à¥à¤¨à¥‹ à¤¸à¤°à¥à¤¤à¤¹à¤°à¥‚ à¤…à¤§à¤¿à¤• à¤²à¤šà¤¿à¤²à¥‹ à¤¬à¤¨à¤¾à¤‰à¤¨à¥à¤¹à¥à¤¨à¥à¤› - à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤šà¤°à¤¹à¤°à¥‚ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¥ˆ à¤¹à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›:
x + y = 8
You can change the values of x and y and the formula can still be true:
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ x à¤° y à¤•à¥‹ à¤®à¤¾à¤¨ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤° à¤¸à¥‚à¤¤à¥à¤° à¤…à¤à¥ˆ à¤ªà¤¨à¤¿ à¤¸à¤¤à¥à¤¯ à¤¹à¥à¤¨ à¤¸à¤•à¥à¤›:
x = 4
y = 4
or (à¤…à¤¥à¤µà¤¾)
x = 3
y = 5
The same is true for programming languages. In programming, variables are containers for values that change. Variables can hold all kinds of values and also the results of computations. Variables have a name and a value separated by an equals sign (=). Variable names can be any letter or word but bear in mind that there are restrictions from language to language of what you can use, as some words are reserved for other functionality.
à¤ªà¥à¤°à¥‹à¤—à¥à¤°à¤¾à¤®à¤¿à¤‚à¤— à¤­à¤¾à¤·à¤¾à¤¹à¤°à¥‚à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤ªà¤¨à¤¿ à¤¯à¤¹à¥€ à¤•à¥à¤°à¤¾ à¤²à¤¾à¤—à¥‚ à¤¹à¥à¤¨à¥à¤›à¥¤ à¤ªà¥à¤°à¥‹à¤—à¥à¤°à¤¾à¤®à¤¿à¤‚à¤—à¤®à¤¾, à¤šà¤°à¤¹à¤°à¥‚ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤¹à¥à¤¨à¥‡ à¤®à¤¾à¤¨à¤¹à¤°à¥‚à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤•à¤¨à¥à¤Ÿà¥‡à¤¨à¤°à¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥à¥¤ à¤šà¤°à¤¹à¤°à¥‚à¤²à¥‡ à¤¸à¤¬à¥ˆ à¤ªà¥à¤°à¤•à¤¾à¤°à¤•à¤¾ à¤®à¤¾à¤¨à¤¹à¤°à¥‚ à¤° à¤—à¤£à¤¨à¤¾à¤¹à¤°à¥‚à¤•à¥‹ à¤ªà¤°à¤¿à¤£à¤¾à¤®à¤¹à¤°à¥‚ à¤ªà¤¨à¤¿ à¤°à¤¾à¤–à¥à¤¨ à¤¸à¤•à¥à¤¦à¤›à¤¨à¥à¥¤ à¤šà¤²à¤¹à¤°à¥‚à¤•à¥‹ à¤¨à¤¾à¤® à¤° à¤®à¤¾à¤¨ à¤¬à¤°à¤¾à¤¬à¤° à¤šà¤¿à¤¨à¥à¤¹ (=) à¤¦à¥à¤µà¤¾à¤°à¤¾ à¤›à¥à¤Ÿà¥à¤¯à¤¾à¤‡à¤à¤•à¥‹ à¤›à¥¤ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨à¤¶à¥€à¤² à¤¨à¤¾à¤®à¤¹à¤°à¥‚ à¤•à¥à¤¨à¥ˆ à¤ªà¤¨à¤¿ à¤…à¤•à¥à¤·à¤° à¤µà¤¾ à¤¶à¤¬à¥à¤¦ à¤¹à¥à¤¨ à¤¸à¤•à¥à¤›à¤¨à¥ à¤¤à¤° à¤®à¤¨à¤®à¤¾ à¤°à¤¾à¤–à¥à¤¨à¥à¤¹à¥‹à¤¸à¥ à¤•à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¥‡ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥‡ à¤­à¤¾à¤·à¤¾à¤¬à¤¾à¤Ÿ à¤­à¤¾à¤·à¤¾à¤®à¤¾ à¤ªà¥à¤°à¤¤à¤¿à¤¬à¤¨à¥à¤§à¤¹à¤°à¥‚ à¤›à¤¨à¥, à¤•à¤¿à¤¨à¤•à¤¿ à¤•à¥‡à¤¹à¥€ à¤¶à¤¬à¥à¤¦à¤¹à¤°à¥‚ à¤…à¤¨à¥à¤¯ à¤•à¤¾à¤°à¥à¤¯à¤•à¥à¤·à¤®à¤¤à¤¾à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤†à¤°à¤•à¥à¤·à¤¿à¤¤ à¤›à¤¨à¥à¥¤
Let's check out how it works in Javascript, The following code defines two variables, computes the result of adding the two, and defines this result as a value of a third variable.
