Equality
à¤¸à¤®à¤¾à¤¨à¤¤à¤¾
Programmers frequently need to determine the equality of variables in relation to other variables. This is done using an equality operator.
à¤ªà¥à¤°à¥‹à¤—à¥à¤°à¤¾à¤®à¤°à¤¹à¤°à¥‚à¤®à¤¾ à¤­à¥à¤¯à¤¾à¤°à¥€à¤à¤¬à¤²à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤®à¥à¤¬à¤¨à¥à¤§à¤®à¤¾ à¤¸à¤®à¤¾à¤¨à¤¤à¤¾ à¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤£ à¤—à¤°à¥à¤¨à¥à¤ªà¤°à¥à¤¦à¤›à¥¤ à¤¯à¥‹ à¤¸à¤®à¤¾à¤¨à¤¤à¤¾ à¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤£ à¤—à¤°à¥à¤¨ à¤¸à¤®à¤¾à¤¨à¤¤à¤¾ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤
The most basic equality operator is the == operator. This operator does everything it can to determine if two variables are equal, even if they are not of the same type.
à¤¸à¤¬ à¤­à¤¨à¥à¤¦à¤¾ à¤†à¤§à¤¾à¤°à¤­à¥‚à¤¤ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° à¤¸à¤®à¤¾à¤¨à¤¤à¤¾ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° (==) à¤¹à¥‹à¥¤ à¤¯à¤¸ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤¯à¥‹ à¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤£ à¤—à¤°à¥à¤¦à¤› à¤•à¤¿ à¤¦à¥à¤ˆ à¤­à¥à¤¯à¤¾à¤°à¥€à¤à¤¬à¤² à¤¬à¤°à¤¾à¤¬à¤° à¤› à¤•à¤¿ à¤›à¥ˆà¤¨à¥¤
For example, assume:
let foo = 42;
let bar = 42;
let baz = "42";
let qux = "life";

foo == bar will evaluate to true and baz == qux will evaluate to false, as one would expect. However, foo == baz will also evaluate to true despite foo and baz being different types. Behind the scenes the == equality operator attempts to force its operands to the same type before determining their equality. This is in contrast to the === equality operator.
foo == bar à¤•à¥‹ à¤®à¥‚à¤²à¥à¤¯à¤¾à¤‚à¤•à¤¨ à¤—à¤°à¥à¤¦à¤¾ à¤¸à¤¾à¤à¤šà¥‹ à¤° baz == qux à¤•à¥‹ à¤²à¤¾à¤—à¥€ à¤à¥‚à¤Ÿà¤¾ à¤•à¥‹ à¤®à¥‚à¤²à¥à¤¯à¤¾à¤‚à¤•à¤¨ à¤¹à¥à¤¨à¥‡à¤›à¥¤foo à¤° Bazà¤¬à¤¿à¤­à¤¿à¤¨à¥à¤¨ à¤ªà¥à¤°à¤•à¤¾à¤°à¤•à¤¾ à¤¬à¤¾à¤µà¤œà¥à¤¦ foo == bazà¤•à¥‹ à¤®à¥‚à¤²à¥à¤¯à¤¾à¤‚à¤•à¤¨ à¤¸à¤¾à¤à¤šà¥‹ à¤¹à¥à¤¨à¥‡à¤›à¥¤ à¤¦à¥ƒà¤¶à¥à¤¯à¤¹à¤°à¥‚à¤•à¥‹ à¤ªà¤›à¤¾à¤¡à¤¿ == à¤¸à¤®à¤¾à¤¨à¤¤à¤¾ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤†à¤«à¥à¤¨à¥‹ à¤¸à¤®à¤¾à¤¨à¤¤à¤¾ à¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤£ à¤—à¤°à¥à¤¨à¥ à¤…à¤˜à¤¿ à¤¯à¤¸à¤•à¥‹ à¤ªà¥à¤°à¤•à¤¾à¤°à¤²à¤¾à¤ˆ à¤…à¤ªà¤°à¥‡à¤Ÿ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¥‹ === à¤¸à¤®à¤¾à¤¨à¤¤à¤¾ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤•à¥‹ à¤µà¤¿à¤ªà¤°à¤¿à¤¤ à¤¹à¥‹à¥¤
The === equality operator determines that two variables are equal if they are of the same type and have the same value. With the same assumptions as before, this means that foo === bar will still evaluate to true, but foo === baz will now evaluate to false. baz === qux will still evaluate to false.
