A switch is a conditional statement that performs actions based on different conditions. It uses strict ( === ) comparison to match the conditions and executes the code blocks of matched condition.  The syntax of the switch expression is shown below.
'à¤¸à¥à¤µà¤¿à¤š' à¤à¤• à¤¸à¤¶à¤°à¥à¤¤ à¤•à¤¥à¤¨ à¤¹à¥‹ à¤œà¥à¤¨ à¤µà¤¿à¤­à¤¿à¤¨à¥à¤¨ à¤…à¤µà¤¸à¥à¤¥à¤¾à¤¹à¤°à¥‚à¤®à¤¾ à¤†à¤§à¤¾à¤°à¤¿à¤¤ à¤•à¤¾à¤°à¥à¤¯à¤¹à¤°à¥‚ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¸à¤²à¥‡ à¤¶à¤°à¥à¤¤à¤¹à¤°à¥‚ à¤®à¤¿à¤²à¤¾à¤¨ à¤—à¤°à¥à¤¨ à¤•à¤¡à¤¾ ('==') à¤¤à¥à¤²à¤¨à¤¾ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¦à¤› à¤° à¤®à¤¿à¤²à¤¾à¤¨ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤…à¤µà¤¸à¥à¤¥à¤¾à¤•à¥‹ à¤•à¥‹à¤¡ à¤¬à¥à¤²à¤•à¤¹à¤°à¥‚ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤  'à¤¸à¥à¤µà¤¿à¤š' à¤…à¤­à¤¿à¤µà¥à¤¯à¤•à¥à¤¤à¤¿à¤•à¥‹ à¤µà¤¾à¤•à¥à¤¯à¤µà¤¿à¤¨à¥à¤¯à¤¾à¤¸ à¤¤à¤² à¤¦à¥‡à¤–à¤¾à¤‡à¤à¤•à¥‹ à¤› à¥¤
switch(expression) {
  case x:
    // code block
    break;
  case y:
    // code block
    break;
  default:
    // code block
}

The expression is evaluated once and is compared with each case. If a match is found, then the associated code block is executed if not default code block is executed. The break keyword stops the execution and can be placed anywhere. In its absence, the next condition is evaluated even if the conditions are not matched. 
à¤…à¤­à¤¿à¤µà¥à¤¯à¤•à¥à¤¤à¤¿ à¤à¤• à¤ªà¤Ÿà¤• à¤®à¥‚à¤²à¥à¤¯à¤¾à¤‚à¤•à¤¨ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤› à¤° à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤®à¤¾à¤®à¤²à¤¾ à¤¸à¤‚à¤— à¤¤à¥à¤²à¤¨à¤¾ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥¤ à¤¯à¤¦à¤¿ à¤®à¥à¤¯à¤¾à¤š à¤«à¥‡à¤²à¤¾ à¤ªà¤°à¥à¤¯à¥‹ à¤­à¤¨à¥‡, à¤¯à¤¦à¤¿ 'à¤ªà¥‚à¤°à¥à¤µà¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤¿à¤¤' à¤•à¥‹à¤¡ à¤¬à¥à¤²à¤• à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥ˆà¤¨ à¤­à¤¨à¥‡ à¤¸à¤®à¥à¤¬à¤¨à¥à¤§à¤¿à¤¤ à¤•à¥‹à¤¡ à¤¬à¥à¤²à¤• à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤ 'à¤¬à¥à¤°à¥‡à¤•' à¤•à¥€à¤µà¤°à¥à¤¡à¤²à¥‡ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤°à¥‹à¤•à¥à¤› à¤° à¤•à¤¹à¥€à¤‚ à¤ªà¤¨à¤¿ à¤°à¤¾à¤–à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤ à¤¯à¤¸à¤•à¥‹ à¤…à¤¨à¥à¤ªà¤¸à¥à¤¥à¤¿à¤¤à¤¿à¤®à¤¾, à¤…à¤°à¥à¤•à¥‹ à¤…à¤µà¤¸à¥à¤¥à¤¾à¤•à¥‹ à¤®à¥‚à¤²à¥à¤¯à¤¾à¤‚à¤•à¤¨ à¤—à¤°à¤¿à¤¨à¥à¤› à¤¯à¤¦à¤¿ à¤¶à¤°à¥à¤¤à¤¹à¤°à¥‚ à¤®à¥‡à¤² à¤–à¤¾à¤à¤¦à¥ˆà¤¨à¤¨à¥ à¤­à¤¨à¥‡ à¤ªà¤¨à¤¿à¥¤
An example of getting a weekday name based on the switch condition is shown below. 
à¤¸à¥à¤µà¤¿à¤š à¤…à¤µà¤¸à¥à¤¥à¤¾à¤•à¥‹ à¤†à¤§à¤¾à¤°à¤®à¤¾ à¤¹à¤ªà¥à¤¤à¤¾à¤•à¥‹ à¤¦à¤¿à¤¨ à¤•à¥‹ à¤¨à¤¾à¤® à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¨à¥‡ à¤à¤• à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¤à¤² à¤¦à¥‡à¤–à¤¾à¤‡à¤à¤•à¥‹ à¤›à¥¤
switch (new Date().getDay()) {
