arrays/map.html.body:
Map
à¤®à¥à¤¯à¤¾à¤ª
The Array.prototype.map() method iterates over an array and modifies its elements using a callback function. The callback function will then be applied to each element of the array.
Array.prototype.map() à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤à¤°à¥‡à¤®à¤¾ à¤ªà¥à¤¨à¤°à¤¾à¤µà¥ƒà¤¤à¥à¤¤à¤¿ à¤—à¤°à¥à¤¦à¤› à¤° à¤•à¤²à¤¬à¥à¤¯à¤¾à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¯à¤¸à¤•à¥‹ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤ªà¤°à¤¿à¤®à¤¾à¤°à¥à¤œà¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤•à¤²à¤¬à¥à¤¯à¤¾à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤¤à¥à¤¯à¤¸à¤ªà¤›à¤¿ à¤¸à¤°à¤£à¥€à¤•à¥‹ à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤¤à¤¤à¥à¤µà¤®à¤¾ à¤²à¤¾à¤—à¥‚ à¤¹à¥à¤¨à¥‡à¤›à¥¤
Here's the syntax for using map:
à¤¯à¤¹à¤¾à¤ à¤®à¥à¤¯à¤¾à¤ª à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤›:
let newArray = oldArray.map(function(element, index, array) {
  // element: current element being processed in the array
  // index: index of the current element being processed in the array
  // array: the array map was called upon
  // Return element to be added to newArray
});

For example, let's say you have an array of numbers and you want to create a new array that doubles the values of the numbers in the original array. You could do this using map like this:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿, à¤®à¤¾à¤¨à¥Œà¤ à¤•à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤¸à¤à¤— à¤¸à¤‚à¤–à¥à¤¯à¤¾à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤°à¤£à¥€ à¤› à¤° à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¨à¤¯à¤¾à¤ à¤¸à¤°à¤£à¥€ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤šà¤¾à¤¹à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤œà¤¸à¤²à¥‡ à¤®à¥‚à¤² à¤¸à¤°à¤£à¥€à¤®à¤¾ à¤¸à¤‚à¤–à¥à¤¯à¤¾à¤¹à¤°à¥‚à¤•à¥‹ à¤®à¤¾à¤¨à¤¹à¤°à¥‚ à¤¡à¤¬à¤² à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¯à¥‹ à¤®à¥à¤¯à¤¾à¤ª à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¯à¥‹ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›:
const numbers = [2, 4, 6, 8];

const doubledNumbers = numbers.map(number => number * 2);

console.log(doubledNumbers);

// Result: [4, 8, 12, 16]

You can also use the arrow function syntax to define the function passed to map:
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ map() à¤®à¤¾ à¤ªà¤¾à¤¸ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤ªà¤°à¤¿à¤­à¤¾à¤·à¤¿à¤¤ à¤—à¤°à¥à¤¨ à¤¬à¤¾à¤£ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤µà¤¾à¤•à¥à¤¯à¤µà¤¿à¤¨à¥à¤¯à¤¾à¤¸ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¥¤
let doubledNumbers = numbers.map((number) => {
  return number * 2;
});


or
let doubledNumbers = numbers.map(number => number * 2);

The map() method doesn't execute function for empty elements and doesn't change the original array.
map() à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤–à¤¾à¤²à¥€ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¥ˆà¤¨ à¤° à¤®à¥Œà¤²à¤¿à¤• à¤à¤°à¥‡ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¦à¥ˆà¤¨ à¥¤

