Spread
à¤«à¥ˆà¤²à¤¨à¥‡
An array or object can be quickly copied into another array or object by using the Spread Operator (...). It allows an iterable such as an array to be expanded in places where zero or more arguments (for function calls) or elements (for array literals) are expected, or an object expression to be expanded in places where zero or more key-value pairs (for object literals) are expected.
à¤¸à¥à¤ªà¥à¤°à¥‡à¤¡ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° (...) à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤à¤°à¥‡ à¤µà¤¾ à¤µà¤¸à¥à¤¤à¥à¤²à¤¾à¤ˆ à¤…à¤°à¥à¤•à¥‹ à¤¸à¤°à¤£à¥€ à¤µà¤¾ à¤µà¤¸à¥à¤¤à¥à¤®à¤¾ à¤›à¤¿à¤Ÿà¥‹ à¤ªà¥à¤°à¤¤à¤¿à¤²à¤¿à¤ªà¤¿ à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤› à¥¤ à¤¯à¤¸à¤²à¥‡ à¤ªà¥à¤¨à¤°à¤¾à¤µà¥ƒà¤¤à¥à¤¤à¤¿ à¤¯à¥‹à¤—à¥à¤¯ à¤œà¤¸à¥à¤¤à¥ˆ à¤¸à¤°à¤£à¥€à¤²à¤¾à¤ˆ à¤¶à¥‚à¤¨à¥à¤¯ à¤µà¤¾ à¤¬à¤¢à¥€ à¤¤à¤°à¥à¤•à¤¹à¤°à¥‚ (à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤•à¤²à¤¹à¤°à¥‚à¤•à¤¾ à¤²à¤¾à¤—à¤¿) à¤µà¤¾ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ (à¤à¤°à¥‡ à¤¶à¤¾à¤¬à¥à¤¦à¤¿à¤•à¤¹à¤°à¥‚à¤•à¤¾ à¤²à¤¾à¤—à¤¿) à¤…à¤ªà¥‡à¤•à¥à¤·à¤¿à¤¤ à¤¸à¥à¤¥à¤¾à¤¨à¤¹à¤°à¥‚à¤®à¤¾ à¤µà¤¿à¤¸à¥à¤¤à¤¾à¤° à¤—à¤°à¥à¤¨ à¤…à¤¨à¥à¤®à¤¤à¤¿ à¤¦à¤¿à¤¨à¥à¤›, à¤µà¤¾ à¤µà¤¸à¥à¤¤à¥ à¤…à¤­à¤¿à¤µà¥à¤¯à¤•à¥à¤¤à¤¿ à¤¶à¥‚à¤¨à¥à¤¯ à¤µà¤¾ à¤…à¤§à¤¿à¤• à¤•à¥à¤žà¥à¤œà¥€-à¤®à¤¾à¤¨ à¤œà¥‹à¤¡à¥€à¤¹à¤°à¥‚ (à¤µà¤¸à¥à¤¤à¥ à¤¶à¤¾à¤¬à¥à¤¦à¤¿à¤•à¤¹à¤°à¥‚à¤•à¤¾ à¤²à¤¾à¤—à¤¿) à¤…à¤ªà¥‡à¤•à¥à¤·à¤¿à¤¤ à¤¸à¥à¤¥à¤¾à¤¨à¤¹à¤°à¥‚à¤®à¤¾ à¤µà¤¿à¤¸à¥à¤¤à¤¾à¤° à¤—à¤°à¥à¤¨ à¤…à¤¨à¥à¤®à¤¤à¤¿ à¤¦à¤¿à¤¨à¥à¤›à¥¤
Here are some  examples of it:
à¤¯à¤¹à¤¾à¤ à¤•à¥‡à¤¹à¤¿ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤¹à¤°à¥‚ à¤›à¤¨à¥:
let arr = [1, 2, 3, 4, 5]; 

console.log(...arr); 
// Result: 1 2 3 4 5

let arr1;
arr1 = [...arr]; //copies the arr into arr1 

console.log(arr1);    //Result: [1, 2, 3, 4, 5]

arr1 = [6,7];
