The spread operator only works in modern browsers that support the feature. If you need to support older browsers, you will need to use a transpiler like Babel to convert the spread operator syntax to equivalent ES5 code.
à¤¸à¥à¤ªà¥à¤°à¥‡à¤¡ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤•à¥‡à¤µà¤² à¤†à¤§à¥à¤¨à¤¿à¤• à¤¬à¥à¤°à¤¾à¤‰à¤œà¤°à¤¹à¤°à¥‚à¤®à¤¾ à¤•à¤¾à¤® à¤—à¤°à¥à¤¦à¤› à¤œà¥à¤¨ à¤¸à¥à¤µà¤¿à¤§à¤¾à¤²à¤¾à¤ˆ à¤¸à¤®à¤°à¥à¤¥à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¤¾à¤ˆ à¤ªà¥à¤°à¤¾à¤¨à¥‹ à¤¬à¥à¤°à¤¾à¤‰à¤œà¤°à¤¹à¤°à¥‚ à¤¸à¤®à¤°à¥à¤¥à¤¨ à¤—à¤°à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤› à¤­à¤¨à¥‡, à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¥‡ à¤¸à¥à¤ªà¥à¤°à¥‡à¤¡ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° à¤µà¤¾à¤•à¥à¤¯à¤µà¤¿à¤¨à¥à¤¯à¤¾à¤¸à¤²à¤¾à¤ˆ à¤¸à¤®à¤•à¤•à¥à¤· à¤ˆà¤à¤¸ 5 à¤•à¥‹à¤¡à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¨ à¤¬à¤¾à¤¬à¥‡à¤² à¤œà¤¸à¥à¤¤à¥‹ à¤Ÿà¥à¤°à¤¾à¤¨à¥à¤¸à¤ªà¤¿à¤²à¤° à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤¹à¥à¤¨à¥‡à¤›à¥¤

arrays/shift.html.body:
Shift
à¤¸à¤¿à¤«à¥à¤Ÿ
shift deletes the first index of that array and moves all indexes to the left. It changes the original array. Here's the syntax for using shift:
à¤¸à¤¿à¤«à¥à¤Ÿ à¤²à¥‡ à¤¤à¥à¤¯à¥‹ à¤à¤°à¥‡à¤•à¥‹ à¤ªà¤¹à¤¿à¤²à¥‹ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾ à¤®à¥‡à¤Ÿà¥à¤¦à¤› à¤° à¤¸à¤¬à¥ˆ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾à¤¹à¤°à¥‚ à¤¬à¤¾à¤¯à¤¾à¤à¤¤à¤¿à¤° à¤¸à¤¾à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¸à¤²à¥‡ à¤®à¥‚à¤² à¤¸à¤°à¤£à¥€ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¹à¤¾à¤ 'à¤¶à¤¿à¤«à¥à¤Ÿ' à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤›:
array.shift();

For example: 
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿:
let array = [1, 2, 3]; 
array.shift(); 

// Result: array = [2,3]

You can also use the shift method in conjunction with a loop to remove all elements from an array. Here's an example of how you might do this:
à¤à¤°à¥à¤°à¥‡à¤¬à¤¾à¤Ÿ à¤¸à¤¬à¥ˆ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤¹à¤Ÿà¤¾à¤‰à¤¨ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤²à¥‚à¤ªà¤•à¥‹ à¤¸à¤‚à¤¯à¥‹à¤œà¤¨à¤®à¤¾ à¤¸à¤¿à¤«à¥à¤Ÿ à¤µà¤¿à¤§à¤¿ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›à¥¤ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¯à¥‹ à¤•à¤¸à¤°à¥€ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤•à¥‹ à¤à¤• à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¯à¤¹à¤¾à¤ à¤›:
while (array.length > 0) {
  array.shift();
}

console.log(array); // Result: []

The shift method only works on arrays, and not on other objects that are similar to arrays such as arguments objects or NodeList objects. If you need to shift elements from one of these types of objects, you will need to convert it to an array first using the Array.prototype.slice() method.
shift à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤à¤°à¥‡à¤¹à¤°à¥‚à¤®à¤¾ à¤®à¤¾à¤¤à¥à¤° à¤•à¤¾à¤® à¤—à¤°à¥à¤¦à¤›, à¤¨ à¤•à¤¿ à¤…à¤¨à¥à¤¯ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚à¤®à¤¾ à¤œà¥à¤¨ à¤à¤°à¥‡à¤¹à¤°à¥‚ à¤œà¤¸à¥à¤¤à¥ˆ à¤¤à¤°à¥à¤• à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤µà¤¾ à¤¨à¥‹à¤¡à¤²à¤¿à¤¸à¥à¤Ÿ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚à¤¸à¤à¤— à¤®à¤¿à¤²à¥à¤¦à¥‹à¤œà¥à¤²à¥à¤¦à¥‹ à¤›à¥¤ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¤¾à¤ˆ à¤¯à¥€ à¤ªà¥à¤°à¤•à¤¾à¤°à¤•à¤¾ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚à¤®à¤§à¥à¤¯à¥‡ à¤•à¥à¤¨à¥ˆ à¤à¤•à¤¬à¤¾à¤Ÿ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤¸à¥à¤¥à¤¾à¤¨à¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤› à¤­à¤¨à¥‡, à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¥‡ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤ªà¤¹à¤¿à¤²à¥‡ Array.prototype.slice() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤à¤°à¥‡à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤›à¥¤

arrays/pop.html.body:
Pop
à¤ªà¤ª
The pop method removes the last element from an array and returns that element. This method changes the length of the array.
'à¤ªà¤ª' à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤à¤°à¥‡à¤¬à¤¾à¤Ÿ à¤…à¤¨à¥à¤¤à¤¿à¤® à¤¤à¤¤à¥à¤µ à¤¹à¤Ÿà¤¾à¤‰à¤à¤¦à¤› à¤° à¤¤à¥à¤¯à¥‹ à¤¤à¤¤à¥à¤µ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤ à¤¯à¥‹ à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤¸à¤°à¤£à¥€à¤•à¥‹ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¦à¤› à¥¤
Here's the syntax for using pop:
à¤¯à¤¹à¤¾à¤ 'à¤ªà¤ª' à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤›:
array.pop();

For example:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¥‹ à¤²à¤¾à¤—à¥€:
let arr = ["one", "two", "three", "four", "five"]; 
arr.pop(); 

console.log(arr); 

// Result: ['one', 'two', 'three', 'four']

You can also use the pop method in conjunction with a loop to remove all elements from an array. Here's an example of how you might do this:
à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤à¤°à¥‡à¤¬à¤¾à¤Ÿ à¤¸à¤¬à¥ˆ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤¹à¤Ÿà¤¾à¤‰à¤¨ à¤²à¥‚à¤ªà¤•à¥‹ à¤¸à¤‚à¤¯à¥‹à¤œà¤¨à¤®à¤¾ 'à¤ªà¤ª' à¤µà¤¿à¤§à¤¿ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›à¥¤ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¯à¥‹ à¤•à¤¸à¤°à¥€ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤•à¥‹ à¤à¤• à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¯à¤¹à¤¾à¤ à¤›:
while (array.length > 0) {
  array.pop();
}

console.log(array); // Result: []

The pop method only works on arrays, and not on other objects that are similar to arrays such as arguments objects or NodeList objects. If you need to pop elements from one of these types of objects, you will need to convert it to an array first using the Array.prototype.slice() method.
à¤ªà¤ª à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤à¤°à¥‡à¤¹à¤°à¥‚à¤®à¤¾ à¤®à¤¾à¤¤à¥à¤° à¤•à¤¾à¤® à¤—à¤°à¥à¤¦à¤›, à¤¨ à¤•à¤¿ à¤…à¤¨à¥à¤¯ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚à¤®à¤¾ à¤œà¥à¤¨ à¤à¤°à¥‡à¤¹à¤°à¥‚ à¤œà¤¸à¥à¤¤à¥ˆ à¤¤à¤°à¥à¤• à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤µà¤¾ à¤¨à¥‹à¤¡à¤²à¤¿à¤¸à¥à¤Ÿ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚à¤¸à¤à¤— à¤®à¤¿à¤²à¥à¤¦à¥‹à¤œà¥à¤²à¥à¤¦à¥‹ à¤›à¥¤ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¤¾à¤ˆ à¤¯à¥€ à¤ªà¥à¤°à¤•à¤¾à¤°à¤•à¤¾ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚à¤®à¤§à¥à¤¯à¥‡ à¤•à¥à¤¨à¥ˆ à¤à¤•à¤¬à¤¾à¤Ÿ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤ªà¤ª à¤—à¤°à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤› à¤­à¤¨à¥‡, à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¥‡ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤ªà¤¹à¤¿à¤²à¥‡ Array.prototype.slice() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¸à¤°à¤£à¥€à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤›à¥¤

arrays/join.html.body:
Join
à¤¸à¤¾à¤®à¥‡à¤²
The join method, makes an array turn into a string and joins it all together. It does not change the original array. Here's the syntax for using join:
à¤¸à¤¾à¤®à¥‡à¤² à¤µà¤¿à¤§à¤¿, à¤à¤• à¤¸à¤°à¤£à¥€ à¤à¤• à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤‚à¤— à¤®à¤¾ à¤¬à¤¾à¤°à¥€ à¤¬à¤¨à¤¾à¤‰à¤à¤› à¤° à¤¯à¥‹ à¤¸à¤¬à¥ˆ à¤à¤• à¤¸à¤¾à¤¥ à¤œà¥‹à¤¡à¤¿à¤¨à¥à¤›à¥¤ à¤¯à¤¸à¤²à¥‡ à¤®à¥‚à¤² à¤¸à¤°à¤£à¥€ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¦à¥ˆà¤¨ à¥¤ à¤¯à¤¹à¤¾à¤ 'à¤¸à¤¾à¤®à¥‡à¤²' à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤›:
array.join([separator]);

The separator argument is optional and specifies the character to be used to separate the elements in the resulting string. If omitted, the array elements are separated with a comma (,).
à¤µà¤¿à¤­à¤¾à¤œà¤• (separator) à¤¤à¤°à¥à¤• à¤µà¥ˆà¤•à¤²à¥à¤ªà¤¿à¤• à¤› à¤° à¤ªà¤°à¤¿à¤£à¤¾à¤®à¥€ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤®à¤¾ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤…à¤²à¤— à¤—à¤°à¥à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥‡ à¤•à¥à¤¯à¤¾à¤°à¥‡à¤•à¥à¤Ÿà¤° à¤¨à¤¿à¤°à¥à¤¦à¤¿à¤·à¥à¤Ÿ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤¯à¤¦à¤¿ à¤›à¥‹à¤¡à¤¿à¤¯à¥‹ à¤­à¤¨à¥‡, à¤¸à¤°à¤£à¥€ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤…à¤²à¥à¤ªà¤µà¤¿à¤°à¤¾à¤® (',') à¤¸à¤à¤— à¤…à¤²à¤— à¤¹à¥à¤¨à¥à¤›à¤¨à¥à¥¤
For example:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¥‹ à¤²à¤¾à¤—à¥€:
let array = ["one", "two", "three", "four"]; 

console.log(array.join(" ")); 

// Result: one two three four

Any separator can be specified but the default one is a comma (,).
à¤•à¥à¤¨à¥ˆ à¤ªà¤¨à¤¿ à¤µà¤¿à¤­à¤¾à¤œà¤• à¤¨à¤¿à¤°à¥à¤¦à¤¿à¤·à¥à¤Ÿ à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤› à¤¤à¤° à¤ªà¥‚à¤°à¥à¤µà¤¨à¤¿à¤°à¥à¤§à¤¾à¤°à¤¿à¤¤ à¤…à¤²à¥à¤ªà¤µà¤¿à¤°à¤¾à¤® (,) à¤¹à¥‹à¥¤

In the above example, a space is used as a separator. You can also use join to convert an array-like object (such as an arguments object or a NodeList object) to a string by first converting it to an array using the Array.prototype.slice() method:
à¤®à¤¾à¤¥à¤¿à¤•à¥‹ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤®à¤¾, à¤à¤• à¤¸à¥à¤¥à¤¾à¤¨ à¤µà¤¿à¤­à¤¾à¤œà¤•à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤ à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤à¤°à¥‡ à¤œà¤¸à¥à¤¤à¥‹ à¤µà¤¸à¥à¤¤à¥ (à¤œà¤¸à¥à¤¤à¥ˆ à¤¤à¤°à¥à¤• à¤µà¤¸à¥à¤¤à¥ à¤µà¤¾ à¤¨à¥‹à¤¡à¤¸à¥‚à¤šà¥€ à¤µà¤¸à¥à¤¤à¥) à¤²à¤¾à¤ˆ à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥à¤¨ à¤¸à¤¾à¤®à¥‡à¤² à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›, à¤¯à¤¸à¤²à¤¾à¤ˆ Array.prototype.slice() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¸à¤°à¤£à¥€à¤®à¤¾ à¤°à¥‚à¤ªà¤¾à¤¨à¥à¤¤à¤°à¤£ à¤—à¤°à¥‡à¤°:
function printArguments() {
  console.log(Array.prototype.slice.call(arguments).join(', '));
}

printArguments('a', 'b', 'c'); // Result: "a, b, c"

arrays/length.html.body:
Length
à¤²à¤®à¥à¤¬à¤¾à¤‡
Arrays have a property called length, and it's pretty much exactly as it sounds, it's the length of the array.
à¤à¤°à¥‡à¤¸à¤à¤— à¤²à¤®à¥à¤¬à¤¾ à¤­à¤¨à¤¿à¤¨à¥‡ à¤—à¥à¤£ à¤›, à¤° à¤¯à¥‹ à¤à¤°à¥‡à¤•à¥‹ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤¹à¥‹à¥¤
let array = [1, 2, 3];

let l = array.length;

// Result: l = 3

The length property also sets the number of elements in an array. For example.
à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤—à¥à¤£à¤²à¥‡ à¤à¤°à¥‡à¤®à¤¾ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤‚à¤–à¥à¤¯à¤¾ à¤ªà¤¨à¤¿ à¤¸à¥‡à¤Ÿ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿:
let fruits = ["Banana", "Orange", "Apple", "Mango"];
fruits.length = 2;

console.log(fruits);
// Result: ['Banana', 'Orange']

You can also use the length property to get the last element of an array by using it as an index. For example:
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤…à¤¨à¥à¤•à¥à¤°à¤®à¤£à¤¿à¤•à¤¾à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¸à¤°à¤£à¥€à¤•à¥‹ à¤…à¤¨à¥à¤¤à¤¿à¤® à¤¤à¤¤à¥à¤µ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¨ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤—à¥à¤£ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿:
console.log(fruits[fruits.length - 1]); // Result: Orange

You can also use the length property to add elements to the end of an array. For example:
à¤¸à¤°à¤£à¥€à¤•à¥‹ à¤…à¤¨à¥à¤¤à¥à¤¯à¤®à¤¾ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤¥à¤ªà¥à¤¨ à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤—à¥à¤£ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿:
fruits[fruits.length] = "Pineapple";
console.log(fruits); // Result: ['Banana', 'Orange', 'Pineapple']

The length property is automatically updated when elements are added or removed from the array.
à¤¸à¤°à¤£à¥€à¤¬à¤¾à¤Ÿ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚ à¤¥à¤ªà¥à¤¦à¤¾ à¤µà¤¾ à¤¹à¤Ÿà¤¾à¤‰à¤à¤¦à¤¾ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤—à¥à¤£ à¤¸à¥à¤µà¤šà¤¾à¤²à¤¿à¤¤ à¤°à¥‚à¤ªà¤®à¤¾ à¤…à¤¦à¥à¤¯à¤¾à¤µà¤§à¤¿à¤• à¤¹à¥à¤¨à¥à¤›à¥¤

It's also worth noting that the length property is not a method, so you don't need to use parentheses when accessing it. It's simply a property of the array object that you can access like any other object property.
à¤¯à¥‹ à¤ªà¤¨à¤¿ à¤Ÿà¤¿à¤ªà¥à¤ªà¤£ à¤¯à¥‹à¤—à¥à¤¯ à¤› à¤•à¤¿ à¤²à¤®à¥à¤¬à¤¾à¤‡ à¤—à¥à¤£ à¤à¤• à¤µà¤¿à¤§à¤¿ à¤¹à¥‹à¤‡à¤¨, à¤¤à¥à¤¯à¤¸à¥ˆà¤²à¥‡ à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤¯à¤¸à¤²à¤¾à¤ˆ à¤ªà¤¹à¥à¤à¤š à¤—à¤°à¥à¤¦à¤¾ à¤•à¥‹à¤·à¥à¤ à¤• à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤›à¥ˆà¤¨à¥¤

arrays/for-each.html.body:
For Each
à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤•à¤•à¥‹ à¤²à¤¾à¤—à¤¿
The forEach method executes a provided function once for each array element. Here's the syntax for using forEach:
à¤«à¥‹à¤°à¤à¤š à¤µà¤¿à¤§à¤¿à¤²à¥‡ à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤¸à¤°à¤£à¥€ à¤¤à¤¤à¥à¤µà¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤à¤• à¤ªà¤Ÿà¤• à¤ªà¥à¤°à¤¦à¤¾à¤¨ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¤› à¥¤ à¤¯à¤¹à¤¾à¤ 'à¤«à¥‹à¤°à¤à¤š' à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤›à¥¤
array.forEach(function(element, index, array) {
  // element: current element being processed in the array
  // index: index of the current element being processed in the array
  // array: the array forEach was called upon
});

For example, let's say you have an array of numbers and you want to print the double of each number to the console. You could do this using forEach like this:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿, à¤®à¤¾à¤¨à¥Œà¤ à¤•à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤¸à¤à¤— à¤¸à¤‚à¤–à¥à¤¯à¤¾à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤°à¤£à¥€ à¤› à¤° à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤•à¤¨à¥à¤¸à¥‹à¤²à¤®à¤¾ à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤¨à¤®à¥à¤¬à¤°à¤•à¥‹ à¤¡à¤¬à¤² à¤®à¥à¤¦à¥à¤°à¤£ à¤—à¤°à¥à¤¨ à¤šà¤¾à¤¹à¤¨à¥à¤¹à¥à¤¨à¥à¤›à¥¤ à¤¤à¤ªà¤¾à¤ˆà¤‚ 'à¤«à¥‹à¤°à¤à¤š' à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¯à¥‹ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥‡à¤›:
let numbers = [1, 2, 3, 4, 5];
numbers.forEach(function(number) {
  console.log(number * 2);
});

You can also use the arrow function syntax to define the function passed to forEach:
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤«à¥‹à¤°à¤à¤š à¤®à¤¾ à¤ªà¤¾à¤¸ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤ªà¤°à¤¿à¤­à¤¾à¤·à¤¿à¤¤ à¤—à¤°à¥à¤¨ à¤¬à¤¾à¤£ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤ªà¤¨à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¥¤
numbers.forEach((number) => {
  console.log(number * 2);
});

or
à¤…à¤¥à¤µà¤¾
numbers.forEach(number => console.log(number * 2));

 forEach does not modify the original array. It simply iterates over the elements of the array and executes the provided function for each element.
à¤«à¥‹à¤°à¤à¤š à¤²à¥‡ à¤®à¥‚à¤² à¤à¤°à¥à¤°à¥‡ à¤ªà¤°à¤¿à¤®à¤¾à¤°à¥à¤œà¤¨ à¤—à¤°à¥à¤¦à¥ˆà¤¨ à¥¤ à¤¯à¥‹ à¤•à¥‡à¤µà¤² à¤à¤°à¥à¤°à¥‡à¤•à¥‹ à¤¤à¤¤à¥à¤µà¤¹à¤°à¥‚à¤®à¤¾ à¤ªà¥à¤¨à¤°à¤¾à¤µà¥ƒà¤¤à¥à¤¤à¤¿ à¤—à¤°à¥à¤¦à¤› à¤° à¤ªà¥à¤°à¤¤à¥à¤¯à¥‡à¤• à¤¤à¤¤à¥à¤µà¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤ªà¥à¤°à¤¦à¤¾à¤¨ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤
The forEach() method is not executed for the empty statment.
à¤–à¤¾à¤²à¥€ à¤•à¤¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ forEach() à¤µà¤¿à¤§à¤¿ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤›à¥ˆà¤¨ à¥¤

loops/while.html.body:
While
à¤µà¤¹à¤¾à¤‡à¤²
