objects/mutable.html.body:
Mutable
à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨à¥€à¤¯
The difference between objects and primitive values is that we can change objects, whereas primitive values are immutable.
à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤° à¤†à¤¦à¤¿à¤® à¤®à¤¾à¤¨à¤¹à¤°à¥‚ à¤¬à¥€à¤šà¤•à¥‹ à¤­à¤¿à¤¨à¥à¤¨à¤¤à¤¾ à¤¯à¥‹ à¤¹à¥‹ à¤•à¤¿ à¤¹à¤¾à¤®à¥€ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤›à¥Œà¤‚, à¤œà¤¬à¤•à¤¿ à¤†à¤¦à¤¿à¤® à¤®à¤¾à¤¨à¤¹à¤°à¥‚ à¤…à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨à¥€à¤¯ à¤¹à¥à¤¨à¥à¥¤
For example:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¥‹ à¤²à¤¾à¤—à¥€:
let myPrimitive = "first value";
myPrimitive = "another value";
// myPrimitive now points to another string.
let myObject = { key: "first value" };
myObject.key = "another value";
// myObject points to the same object.

You can add, modify, or delete properties of an object using the dot notation or the square bracket notation.
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤¡à¤Ÿ à¤¨à¥‹à¤Ÿà¥‡à¤¸à¤¨ à¤µà¤¾ à¤¸à¥à¤•à¥à¤µà¤¾à¤¯à¤° à¤•à¥‹à¤·à¥à¤ à¤• à¤¨à¥‹à¤Ÿà¥‡à¤¸à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤—à¥à¤£ à¤¥à¤ªà¥à¤¨, à¤ªà¤°à¤¿à¤®à¤¾à¤°à¥à¤œà¤¨ à¤—à¤°à¥à¤¨ à¤µà¤¾ à¤®à¥‡à¤Ÿà¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¥¤
let object = {};
object.foo = 'bar'; // Add property 'foo'
object['baz'] = 'qux'; // Add property 'baz'
object.foo = 'quux'; // Modify property 'foo'
delete object.baz; // Delete property 'baz'

Primitive values (such as numbers and strings) are immutable, while objects (such as arrays and objects) are mutable.
à¤†à¤¦à¤¿à¤® à¤®à¤¾à¤¨à¤¹à¤°à¥‚ (à¤œà¤¸à¥à¤¤à¥ˆ à¤¸à¤‚à¤–à¥à¤¯à¤¾ à¤° à¤¸à¥à¤Ÿà¥à¤°à¤¿à¤™à¤¹à¤°à¥‚) à¤…à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨à¥€à¤¯ à¤›à¤¨à¥, à¤œà¤¬à¤•à¤¿ à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ (à¤œà¤¸à¥à¤¤à¥ˆ à¤à¤°à¥‡ à¤° à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚) à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨à¤¶à¥€à¤² à¤›à¤¨à¥à¥¤

objects/reference.html.body:
Reference
à¤¸à¤¨à¥à¤¦à¤°à¥à¤­
Objects are never copied. They are passed around by reference. An object reference is a value that refers to an object. When you create an object using the new operator or object literal syntax, JavaScript creates an object and assigns a reference to it.
à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤ªà¥à¤°à¤¤à¤¿à¤²à¤¿à¤ªà¤¿ à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤à¤¦à¥ˆà¤¨ à¥¤ à¤¤à¤¿à¤¨à¥€à¤¹à¤°à¥‚ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­ à¤¦à¥à¤µà¤¾à¤°à¤¾ à¤µà¤°à¤¿à¤ªà¤°à¤¿ à¤ªà¤¾à¤°à¤¿à¤¤ à¤›à¤¨à¥à¥¤ à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­ à¤à¤‰à¤Ÿà¤¾ à¤®à¤¾à¤¨ à¤¹à¥‹ à¤œà¤¸à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤²à¤¾à¤ˆ à¤¬à¥à¤à¤¾à¤‰à¤à¤›à¥¤ à¤œà¤¬ à¤¤à¤ªà¤¾à¤ˆà¤‚ new à¤…à¤ªà¤°à¥‡à¤Ÿà¤° à¤µà¤¾ à¤µà¤¸à¥à¤¤à¥ à¤¶à¤¾à¤¬à¥à¤¦à¤¿à¤• à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›, à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤²à¥‡ à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¦à¤› à¤° à¤¯à¤¸à¤²à¤¾à¤ˆ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­ à¤ªà¥à¤°à¤¦à¤¾à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤
Here's an example of creating an object using the object literal syntax:
à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤¶à¤¾à¤¬à¥à¤¦à¤¿à¤• à¤µà¤¾à¤•à¥à¤¯à¤µà¤¿à¤¨à¥à¤¯à¤¾à¤¸ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨à¥‡ à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¯à¤¹à¤¾à¤ à¤›:
var object = {
  foo: 'bar'
};

Here's an example of creating an object using the new operator:
à¤¯à¤¹à¤¾à¤ new à¤…à¤ªà¤°à¥‡à¤Ÿà¤° à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨à¥‡ à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤›:
var object = new Object();
object.foo = 'bar';

When you assign an object reference to a variable, the variable simply holds a reference to the object, not the object itself. This means that if you assign the object reference to another variable, both variables will point to the same object.
à¤œà¤¬ à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤à¤‰à¤Ÿà¤¾ à¤šà¤²à¤²à¤¾à¤ˆ à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­ à¤¨à¤¿à¤°à¥à¤¦à¤¿à¤·à¥à¤Ÿ à¤—à¤°à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›, à¤šà¤°à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­ à¤®à¤¾à¤¤à¥à¤° à¤°à¤¾à¤–à¥à¤›, à¤µà¤¸à¥à¤¤à¥à¤²à¤¾à¤ˆ à¤¹à¥‹à¤‡à¤¨à¥¤ à¤¯à¤¸à¤•à¥‹ à¤…à¤°à¥à¤¥ à¤¯à¥‹ à¤¹à¥‹ à¤•à¤¿ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­à¤²à¤¾à¤ˆ à¤…à¤°à¥à¤•à¥‹ à¤šà¤°à¤®à¤¾ à¤¨à¤¿à¤°à¥à¤¦à¤¿à¤·à¥à¤Ÿ à¤—à¤°à¥à¤¨à¥à¤­à¤¯à¥‹ à¤­à¤¨à¥‡, à¤¦à¥à¤µà¥ˆ à¤šà¤²à¤¹à¤°à¥‚à¤²à¥‡ à¤à¤‰à¤Ÿà¥ˆ à¤µà¤¸à¥à¤¤à¥à¤²à¤¾à¤ˆ à¤‡à¤‚à¤—à¤¿à¤¤ à¤—à¤°à¥à¤¨à¥‡à¤›à¤¨à¥à¥¤
For example:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¥‹ à¤²à¤¾à¤—à¥€:
var object1 = {
  foo: 'bar'
};

var object2 = object1;

console.log(object1 === object2); // Output: true

In the example above, both object1 and object2 are variables that hold references to the same object. The === operator is used to compare the references, not the objects themselves, and it returns true because both variables hold references to the same object.
à¤®à¤¾à¤¥à¤¿à¤•à¥‹ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤®à¤¾, object1 à¤° object2 à¤¦à¥à¤µà¥ˆ à¤šà¤°à¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥ à¤œà¤¸à¤²à¥‡ à¤à¤‰à¤Ÿà¥ˆ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­ à¤°à¤¾à¤–à¥à¤›à¤¨à¥à¥¤ === à¤…à¤ªà¤°à¥‡à¤Ÿà¤° à¤¸à¤¨à¥à¤¦à¤°à¥à¤­à¤¹à¤°à¥‚ à¤¤à¥à¤²à¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›, à¤µà¤¸à¥à¤¤à¥à¤¹à¤°à¥‚ à¤†à¤«à¥ˆà¤²à¤¾à¤ˆ à¤¹à¥‹à¤‡à¤¨, à¤° à¤¯à¤¸à¤²à¥‡ à¤¸à¤¤à¥à¤¯ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤› à¤•à¤¿à¤¨à¤•à¤¿ à¤¦à¥à¤µà¥ˆ à¤šà¤°à¤¹à¤°à¥‚à¤²à¥‡ à¤à¤‰à¤Ÿà¥ˆ à¤µà¤¸à¥à¤¤à¥à¤®à¤¾ à¤¸à¤¨à¥à¤¦à¤°à¥à¤­à¤¹à¤°à¥‚ à¤°à¤¾à¤–à¥à¤›à¤¨à¥à¥¤
You can use the Object.assign() method to create a new object that is a copy of an existing object. 
à¤¤à¤ªà¤¾à¤ˆà¤à¤²à¥‡ à¤…à¤µà¤¸à¥à¤¥à¤¿à¤¤ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤ªà¥à¤°à¤¤à¤¿à¤²à¤¿à¤ªà¤¿ à¤­à¤à¤•à¥‹ à¤¨à¤¯à¤¾à¤ à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ Object.assign() à¤µà¤¿à¤§à¤¿ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¥¤

Following is an example of an object by reference .
à¤¸à¤¨à¥à¤¦à¤°à¥à¤­à¤¦à¥à¤µà¤¾à¤°à¤¾ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¤à¤² à¤¦à¤¿à¤‡à¤à¤•à¥‹ à¤› à¥¤
// Imagine I had a pizza
let myPizza = { slices: 5 };
// And I shared it with You
let yourPizza = myPizza;
// I eat another slice
myPizza.slices = myPizza.slices - 1;
let numberOfSlicesLeft = yourPizza.slices;
// Now We have 4 slices because myPizza and yourPizza
// reference to the same pizza object.
let a = {},
  b = {},
  c = {};
// a, b, and c each refer to a
// different empty object
a = b = c = {};
// a, b, and c all refer to
// the same empty object

objects/delete.html.body:
Delete
à¤¡à¤¿à¤²à¤¿à¤Ÿ
A delete property can be used to remove a property from an object. When a property is deleted, it is removed from the object and cannot be accessed or enumerated (i.e., it does not show up in a for-in loop).
'à¤¡à¤¿à¤²à¤¿à¤Ÿ(à¤®à¥‡à¤Ÿà¥à¤¨à¥à¤¹à¥‹à¤¸à¥)' à¤—à¥à¤£ à¤µà¤¸à¥à¤¤à¥à¤¬à¤¾à¤Ÿ à¤—à¥à¤£ à¤¹à¤Ÿà¤¾à¤‰à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤ à¤œà¤¬ à¤•à¥à¤¨à¥ˆ à¤—à¥à¤£ à¤®à¥‡à¤Ÿà¤¿à¤¨à¥à¤›, à¤¯à¤¸à¤²à¤¾à¤ˆ à¤µà¤¸à¥à¤¤à¥à¤¬à¤¾à¤Ÿ à¤¹à¤Ÿà¤¾à¤‡à¤¨à¥à¤› à¤° à¤ªà¤¹à¥à¤à¤š à¤—à¤°à¥à¤¨ à¤µà¤¾ à¤—à¤£à¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤à¤¦à¥ˆà¤¨ (à¤œà¤¸à¥à¤¤à¥ˆ, à¤¯à¥‹ à¤«à¥‹à¤°-à¤‡à¤¨ à¤²à¥‚à¤ªà¤®à¤¾ à¤¦à¥‡à¤–à¤¾ à¤ªà¤°à¥à¤¦à¥ˆà¤¨)à¥¤
Here's the syntax for using delete:
à¤¯à¤¹à¤¾à¤ 'à¤®à¥‡à¤Ÿà¥à¤¨à¥à¤¹à¥‹à¤¸à¥' à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾ à¤›:
delete object.property;

For example:
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¥‹ à¤²à¤¾à¤—à¥€:
let adult = { age: 26 },
  child = Object.create(adult);

child.age = 8;

delete child.age;

/* Remove age property from child, revealing the age of the prototype, because then it is not overriden. */

let prototypeAge = child.age;
// 26, because child does not have its own age property.

The delete operator only works on own properties of an object, and not on inherited properties. It also does not work on properties that have the configurable attribute set to false.
'à¤®à¥‡à¤Ÿà¥à¤¨à¥à¤¹à¥‹à¤¸à¥' à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤†à¤«à¥à¤¨à¥ˆ à¤—à¥à¤£à¤¹à¤°à¥‚à¤®à¤¾ à¤®à¤¾à¤¤à¥à¤° à¤•à¤¾à¤® à¤—à¤°à¥à¤¦à¤›, à¤° à¤µà¤‚à¤¶à¤¾à¤¨à¥à¤—à¤¤ à¤—à¥à¤£à¤¹à¤°à¥‚à¤®à¤¾ à¤¹à¥‹à¤‡à¤¨à¥¤ à¤¯à¤¸à¤²à¥‡ 'à¤•à¤¨à¥à¤«à¤¿à¤—à¤°à¥‡à¤¸à¤¨ à¤¯à¥‹à¤—à¥à¤¯' à¤µà¤¿à¤¶à¥‡à¤·à¤¤à¤¾ 'à¤—à¤²à¤¤' à¤®à¤¾ à¤¸à¥‡à¤Ÿ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤—à¥à¤£à¤¹à¤°à¥‚à¤®à¤¾ à¤ªà¤¨à¤¿ à¤•à¤¾à¤® à¤—à¤°à¥à¤¦à¥ˆà¤¨à¥¤

The delete operator does not modify the object's prototype chain. It simply removes the specified property from the object and also it does not actually destroy the object or its properties. It simply makes the properties inaccessible. If you need to destroy an object and release its memory, you can set the object to null or use a garbage collector to reclaim the memory.
'à¤®à¥‡à¤Ÿà¥à¤¨à¥à¤¹à¥‹à¤¸à¥' à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤ªà¥à¤°à¥‹à¤Ÿà¥‹à¤Ÿà¤¾à¤‡à¤ª à¤¶à¥à¤°à¥ƒà¤‚à¤–à¤²à¤¾ à¤ªà¤°à¤¿à¤®à¤¾à¤°à¥à¤œà¤¨ à¤—à¤°à¥à¤¦à¥ˆà¤¨à¥¤ à¤¯à¤¸à¤²à¥‡ à¤•à¥‡à¤µà¤² à¤µà¤¸à¥à¤¤à¥à¤¬à¤¾à¤Ÿ à¤¨à¤¿à¤°à¥à¤¦à¤¿à¤·à¥à¤Ÿ à¤—à¥à¤£ à¤¹à¤Ÿà¤¾à¤‰à¤à¤¦à¤› à¤° à¤¯à¤¸à¤²à¥‡ à¤µà¤¾à¤¸à¥à¤¤à¤µà¤®à¤¾ à¤µà¤¸à¥à¤¤à¥ à¤µà¤¾ à¤¯à¤¸à¤•à¥‹ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤¨à¤·à¥à¤Ÿ à¤—à¤°à¥à¤¦à¥ˆà¤¨à¥¤ à¤¯à¤¸à¤²à¥‡ à¤•à¥‡à¤µà¤² à¤—à¥à¤£à¤¹à¤°à¥‚ à¤ªà¤¹à¥à¤à¤š à¤¯à¥‹à¤—à¥à¤¯ à¤¬à¤¨à¤¾à¤‰à¤à¤¦à¤›à¥¤ à¤¯à¤¦à¤¿ à¤¤à¤ªà¤¾à¤ˆà¤‚à¤²à¤¾à¤ˆ à¤•à¥à¤¨à¥ˆ à¤µà¤¸à¥à¤¤à¥à¤²à¤¾à¤ˆ à¤¨à¤·à¥à¤Ÿ à¤—à¤°à¥à¤¨ à¤° à¤¯à¤¸à¤•à¥‹ à¤®à¥‡à¤®à¥‹à¤°à¥€ à¤›à¥‹à¤¡à¥à¤¨ à¤†à¤µà¤¶à¥à¤¯à¤• à¤› à¤­à¤¨à¥‡, à¤¤à¤ªà¤¾à¤ˆà¤‚ à¤µà¤¸à¥à¤¤à¥à¤²à¤¾à¤ˆ 'à¤¶à¥‚à¤¨à¥à¤¯' à¤®à¤¾ à¤¸à¥‡à¤Ÿ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤› à¤µà¤¾ à¤®à¥‡à¤®à¥‹à¤°à¥€ à¤ªà¥à¤¨à¤ƒ à¤ªà¥à¤°à¤¾à¤ªà¥à¤¤ à¤—à¤°à¥à¤¨ à¤«à¥‹à¤¹à¥‹à¤° à¤¸à¤‚à¤•à¤²à¤• à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¨à¥à¤¹à¥à¤¨à¥à¤›à¥¤

error-handling/try...catch...finally.htm.body:
try...catch...finally
à¤ªà¥à¤°à¤¯à¤¾à¤¸ ... à¤•à¥à¤¯à¤¾à¤š ... à¤…à¤¨à¥à¤¤à¤®à¤¾
We can add one more construct to try...catch called finally, this code executes in all cases. i.e. after try when there is no error and after a catch in case of error. The syntax for try ...catch...finally is shown below.
à¤¹à¤¾à¤®à¥€ à¤à¤• à¤…à¤°à¥à¤•à¥‹ à¤à¤• à¤…à¤°à¥à¤¡à¤° à¤¥à¤ªà¥à¤¨ à¤¸à¤•à¥à¤¦à¤›à¥Œà¤‚ `à¤ªà¥à¤°à¤¯à¤¾à¤¸ à¤—à¤°à¥à¤¨à¥à¤¹à¥‹à¤¸à¥ ... à¤•à¥à¤¯à¤¾à¤š" à¤œà¤¸à¤²à¤¾à¤ˆ 'à¤…à¤¨à¥à¤¤à¤®à¤¾' à¤­à¤¨à¤¿à¤¨à¥à¤›, à¤¯à¥‹ à¤•à¥‹à¤¡ à¤¸à¤¬à¥ˆ à¤…à¤µà¤¸à¥à¤¥à¤¾à¤®à¤¾ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤…à¤°à¥à¤¥à¤¾à¤¤à¥ 'à¤ªà¥à¤°à¤¯à¤¾à¤¸' à¤ªà¤›à¤¿ à¤œà¤¬ à¤¤à¥à¤¯à¤¹à¤¾à¤ à¤•à¥à¤¨à¥ˆ à¤¤à¥à¤°à¥à¤Ÿà¤¿ à¤›à¥ˆà¤¨ à¤° à¤¤à¥à¤°à¥à¤Ÿà¤¿à¤•à¥‹ à¤®à¤¾à¤®à¤²à¤¾à¤®à¤¾ 'à¤•à¥à¤¯à¤¾à¤š' à¤ªà¤›à¤¿à¥¤ 'à¤ªà¥à¤°à¤¯à¤¾à¤¸ à¤—à¤°à¥à¤¨à¥à¤¹à¥‹à¤¸à¥ ... à¤ªà¤•à¤¡à¤¼à¥‹... à¤…à¤¨à¥à¤¤à¤®à¤¾' à¤¤à¤² à¤¦à¥‡à¤–à¤¾à¤‡à¤à¤•à¥‹ à¤›à¥¤
try {
   // try to execute the code
} catch (err) {
    // handle errors 
} finally {
   // execute always
}

Running real-world example code.
à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿à¥¤
try {
  alert( 'try' );
} catch (err) {
  alert( 'catch' );
} finally {
  alert( 'finally' );
