Classes
à¤µà¤°à¥à¤—
Classes are templates for creating an object. It encapsulates data with code to work on with data. The keyword class is used to create a class.  And a specific method called constructor is used for creating and initializing an object created with a class. An example of car class is shown below.
à¤µà¤°à¥à¤—à¤¹à¤°à¥‚ (classes) à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤Ÿà¥‡à¤®à¥à¤ªà¥à¤²à¥‡à¤Ÿà¤¹à¤°à¥‚ à¤¹à¥à¤¨à¥à¥¤ à¤¯à¤¸à¤²à¥‡ à¤¡à¥‡à¤Ÿà¤¾à¤•à¥‹ à¤¸à¤¾à¤¥ à¤•à¤¾à¤® à¤—à¤°à¥à¤¨ à¤•à¥‹à¤¡à¤•à¥‹ à¤¸à¤¾à¤¥ à¤¡à¥‡à¤Ÿà¤¾ à¤²à¤¾à¤ˆ à¤¸à¤®à¤¾à¤¹à¤¿à¤¤ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤•à¥à¤žà¥à¤œà¥€à¤¶à¤¬à¥à¤¦ 'à¤µà¤°à¥à¤—' à¤µà¤°à¥à¤— à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤  à¤° 'à¤•à¤¨à¥à¤¸à¥à¤Ÿà¥à¤°à¤•à¥à¤Ÿà¤°' à¤¨à¤¾à¤®à¤• à¤à¤• à¤µà¤¿à¤¶à¤¿à¤·à¥à¤Ÿ à¤µà¤¿à¤§à¤¿ 'à¤µà¤°à¥à¤—' à¤•à¥‹ à¤¸à¤¾à¤¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤µà¤¸à¥à¤¤à¥ à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ à¤° à¤¸à¥à¤°à¥ à¤—à¤°à¥à¤¨ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤ à¤•à¤¾à¤° à¤µà¤°à¥à¤—à¤•à¥‹ à¤à¤• à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¤à¤² à¤¦à¥‡à¤–à¤¾à¤‡à¤à¤•à¥‹ à¤›à¥¤
class Car {
  constructor(name, year) {
    this.name = name;
    this.year = year;
  }
  age() {
    let date = new Date();
    return date.getFullYear() - this.year;
  }
}

