The inheritance is useful for code reusability purposes as it extends existing properties and methods of a class. The extends keyword is used to create a class inheritance.  
à¤‰à¤¤à¥à¤¤à¤°à¤¾à¤§à¤¿à¤•à¤¾à¤° à¤•à¥‹à¤¡ à¤ªà¥à¤¨: à¤ªà¥à¤°à¤¯à¥‹à¤œà¥à¤¯ à¤‰à¤¦à¥à¤¦à¥‡à¤¶à¥à¤¯à¤¹à¤°à¥‚à¤•à¥‹ à¤²à¤¾à¤—à¤¿ à¤‰à¤ªà¤¯à¥‹à¤—à¥€ à¤› à¤•à¤¿à¤¨à¤•à¤¿ à¤¯à¤¸à¤²à¥‡ à¤à¤• à¤µà¤°à¥à¤—à¤•à¥‹ à¤…à¤µà¤¸à¥à¤¥à¤¿à¤¤ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤° à¤µà¤¿à¤§à¤¿à¤¹à¤°à¥‚ à¤µà¤¿à¤¸à¥à¤¤à¤¾à¤° à¤—à¤°à¥à¤¦à¤›à¥¤ à¤µà¤°à¥à¤— à¤µà¤‚à¤¶à¤¾à¤¨à¥à¤•à¥à¤°à¤® à¤¸à¤¿à¤°à¥à¤œà¤¨à¤¾ à¤—à¤°à¥à¤¨ extends à¤•à¥€à¤µà¤°à¥à¤¡ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¤¿à¤¨à¥à¤›à¥¤
class Car {
  constructor(brand) {
    this.carname = brand;
  }
  present() {
    return 'I have a ' + this.carname;
  }
}

