à¤…à¤¸à¤¿à¤‚à¤•/à¤ªà¥à¤°à¤¤à¤¿à¤•à¥à¤·à¤¾
With promises, one can use a async keyword to declare an asynchronous function that returns a promise whereas the await  syntax makes JavaScript wait until that promise settles and returns its value. These keywords make promises easier to write.  An example of async is shown below.
à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾à¤¹à¤°à¥‚à¤•à¥‹ à¤¸à¤¾à¤¥, à¤à¤• à¤à¤¸à¤¿à¤‚à¤• à¤•à¥€à¤µà¤°à¥à¤¡ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¦à¤› à¤à¤• à¤à¤¸à¤¿à¤‚à¤•à¥à¤°à¥‹à¤¨à¤¸ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤˜à¥‹à¤·à¤£à¤¾ à¤—à¤°à¥à¤¨ à¤œà¤¸à¤²à¥‡ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤› à¤œà¤¬à¤•à¤¿ à¤ªà¥à¤°à¤¤à¥€à¤•à¥à¤·à¤¾ à¤µà¤¾à¤•à¥à¤¯à¤°à¤šà¤¨à¤¾à¤²à¥‡ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤²à¤¾à¤ˆ à¤ªà¥à¤°à¤¤à¥€à¤•à¥à¤·à¤¾ à¤—à¤°à¥à¤¦à¤› à¤œà¤¬à¤¸à¤®à¥à¤® à¤¤à¥à¤¯à¥‹ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤µà¥à¤¯à¤µà¤¸à¥à¤¥à¤¿à¤¤ à¤¹à¥à¤à¤¦à¥ˆà¤¨ à¤° à¤¯à¤¸à¤•à¥‹ à¤®à¤¾à¤¨ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›à¥¤ à¤¯à¥€ à¤•à¥à¤žà¥à¤œà¥€à¤¶à¤¬à¥à¤¦à¤¹à¤°à¥‚à¤²à¥‡ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾à¤¹à¤°à¥‚ à¤²à¥‡à¤–à¥à¤¨ à¤¸à¤œà¤¿à¤²à¥‹ à¤¬à¤¨à¤¾à¤‰à¤à¤¦à¤›à¥¤  à¤à¤¸à¤¿à¤‚à¤•à¤•à¥‹ à¤à¤• à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¤à¤² à¤¦à¥‡à¤–à¤¾à¤‡à¤à¤•à¥‹ à¤›à¥¤
//async function f
async function f() {
  return 1;
}
// promise being resolved
f().then(alert); // 1

The above example can be written as follows:
à¤®à¤¾à¤¥à¤¿à¤•à¥‹ à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¨à¤¿à¤®à¥à¤¨à¤•à¥‹ à¤°à¥‚à¤ªà¤®à¤¾ à¤²à¥‡à¤–à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›:
function f() {
