async ensures that the function returns a promise, and wraps non-promises in it. With await, we can make JavaScript wait until the promise is settled with its value returned. 
à¤à¤¸à¤¿à¤‚à¤• à¤²à¥‡ à¤¯à¥‹ à¤¸à¥à¤¨à¤¿à¤¶à¥à¤šà¤¿à¤¤ à¤—à¤°à¥à¤¦à¤› à¤•à¤¿ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯à¤²à¥‡ à¤à¤• à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›, à¤° à¤¯à¤¸à¤®à¤¾ à¤—à¥ˆà¤°-à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾à¤¹à¤°à¥‚ à¤²à¤ªà¥‡à¤Ÿà¥à¤¦à¤›à¥¤ à¤ªà¥à¤°à¤¤à¥€à¤•à¥à¤·à¤¾ à¤•à¥‹ à¤¸à¤¾à¤¥, à¤¹à¤¾à¤®à¥€ à¤œà¤¾à¤­à¤¾à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤²à¤¾à¤ˆ à¤ªà¥à¤°à¤¤à¤¿à¤•à¥à¤·à¤¾ à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¦à¤›à¥Œà¤‚ à¤œà¤¬à¤¸à¤®à¥à¤® à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤¯à¤¸à¤•à¥‹ à¤®à¥‚à¤²à¥à¤¯ à¤«à¤¿à¤°à¥à¤¤à¤¾ à¤•à¥‹ à¤¸à¤¾à¤¥ à¤µà¥à¤¯à¤µà¤¸à¥à¤¥à¤¿à¤¤ à¤¹à¥à¤à¤¦à¥ˆà¤¨à¥¤
async function f() {
  let promise = new Promise((resolve, reject) => {
    setTimeout(() => resolve("Welcome to Learn JavaScript!"), 1000)
  });

