à¤†à¤§à¤¾à¤°à¤­à¥‚à¤¤ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤¹à¤°à¥‚
Mathematic operations to numbers can be performed using some basic operators like:
à¤—à¤£à¤¿à¤¤à¥€à¤¯ à¤…à¤ªà¤°à¥‡à¤¶à¤¨à¤¹à¤°à¥‚ à¤¨à¤®à¥à¤¬à¤°à¤¹à¤°à¥‚ à¤•à¥‡à¤¹à¤¿ à¤†à¤§à¤¾à¤°à¤­à¥‚à¤¤ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤¹à¤°à¥‚ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›:

Addition operator (+): The addition operator adds two numbers together. For example:

à¤…à¤¤à¤¿à¤°à¤¿à¤•à¥à¤¤ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° (+):: à¤¯à¤…à¤¤à¤¿à¤°à¤¿à¤•à¥à¤¤ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤¦à¥à¤ˆ à¤¨à¤®à¥à¤¬à¤°à¤¹à¤°à¥‚ à¤à¤•à¤¸à¤¾à¤¥ à¤¥à¤ªà¥à¤¦à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿:


