Subtraction operator (-): The subtraction operator subtracts one number from another. For example:

à¤˜à¤Ÿà¤¾à¤‰ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° (-): à¤˜à¤Ÿà¤¾à¤‰ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤à¤‰à¤Ÿà¤¾ à¤¨à¤®à¥à¤¬à¤°à¤²à¤¾à¤ˆ à¤…à¤°à¥à¤•à¥‹à¤¬à¤¾à¤Ÿ à¤˜à¤Ÿà¤¾à¤‰à¤à¤¦à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿:


