console.log(3 - (-2)); // 5


Multiplication operator (*): The multiplication operator multiplies two numbers. For example:

à¤—à¥à¤£à¤¨ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° (* ): à¤—à¥à¤£à¤¨ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¤¾à¤ˆ à¤¦à¥à¤ˆ à¤¨à¤®à¥à¤¬à¤° à¤—à¥à¤£à¤¾ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤•à¥‹ à¤²à¤¾à¤—à¥€:


