Division operator (/): The division operator divides one number by another. For example:

à¤¡à¤¿à¤­à¤¿à¤œà¤¨ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° (/): à¤¡à¤¿à¤­à¤¿à¤œà¤¨ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤à¤• à¤¨à¤®à¥à¤¬à¤°à¤²à¤¾à¤ˆ à¤…à¤°à¥à¤•à¥‹à¤²à¥‡ à¤µà¤¿à¤­à¤¾à¤œà¤¨ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¤•à¤¾ à¤²à¤¾à¤—à¤¿:


