console.log(6 / (-2)); // -3


Remainder operator (%): The remainder operator returns the remainder of a division operation. For example:

à¤¬à¤¾à¤à¤•à¥€ à¤…à¤ªà¤°à¥‡à¤Ÿà¤° (%): à¤¬à¤¾à¤à¤•à¥€ à¤…à¤ªà¤°à¥‡à¤Ÿà¤°à¤²à¥‡ à¤¡à¤¿à¤­à¤¿à¤œà¤¨ à¤…à¤ªà¤°à¥‡à¤¶à¤¨à¤•à¤¾ à¤¬à¤¾à¤à¤•à¥€ à¤­à¤¾à¤— à¤«à¤¿à¤°à¥à¤¤à¤¾ à¤—à¤°à¥à¤¦à¤›à¥¤ à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤•à¥‹ à¤²à¤¾à¤—à¥€:


