Instead of halting the code execution, we can use the try...catch construct that allows catching errors without dying the script. The try...catch construct has two main blocks; try and then catch. 
à¤•à¥‹à¤¡ à¤•à¤¾à¤°à¥à¤¯à¤¾à¤¨à¥à¤µà¤¯à¤¨ à¤°à¥‹à¤•à¥à¤¨à¥à¤•à¥‹ à¤¸à¤Ÿà¥à¤Ÿà¤¾, à¤¹à¤¾à¤®à¥€ à¤ªà¥à¤°à¤¯à¤¾à¤¸ à¤—à¤°à¥à¤¨à¥à¤¹à¥‹à¤¸à¥ ... à¤•à¥à¤¯à¤¾à¤š à¤¨à¤¿à¤°à¥à¤®à¤¾à¤£ à¤œà¤¸à¤²à¥‡ à¤¸à¥à¤•à¥à¤°à¤¿à¤ªà¥à¤Ÿà¤•à¥‹ à¤®à¥ƒà¤¤à¥à¤¯à¥ à¤¬à¤¿à¤¨à¤¾ à¤¤à¥à¤°à¥à¤Ÿà¤¿à¤¹à¤°à¥‚ à¤¸à¤®à¤¾à¤¤à¥à¤¨ à¤…à¤¨à¥à¤®à¤¤à¤¿ à¤¦à¤¿à¤¨à¥à¤›à¥¤ 'à¤•à¥‹à¤¶à¤¿à¤¶... à¤•à¥à¤¯à¤¾à¤š 'à¤•à¤¨à¥à¤¸à¥à¤Ÿà¥à¤°à¤•à¥à¤Ÿà¤®à¤¾ à¤¦à¥à¤ˆ à¤®à¥à¤–à¥à¤¯ à¤¬à¥à¤²à¤•à¤¹à¤°à¥‚ à¤›à¤¨à¥; 'à¤•à¥‹à¤¶à¤¿à¤¶' à¤”à¤° à¤«à¤¿à¤° 'à¤•à¥ˆà¤š'à¥¤
