resolve(value): a callback function that returns value upon result
(à¤à¤• à¤•à¤²à¤¬à¥à¤¯à¤¾à¤• à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤œà¤¸à¤²à¥‡ à¤ªà¤°à¤¿à¤£à¤¾à¤®à¤®à¤¾ 'à¤®à¤¾à¤¨' à¤«à¤°à¥à¤•à¤¾à¤‰à¤à¤›)

