The internal properties of promise object returned by the new Promise constructor are as follows:
'à¤¨à¤¯à¤¾à¤ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾' à¤•à¤¨à¥à¤¸à¥à¤Ÿà¥à¤°à¤•à¥à¤Ÿà¤°à¤¦à¥à¤µà¤¾à¤°à¤¾ à¤«à¤¿à¤°à¥à¤¤à¤¾ à¤—à¤°à¤¿à¤à¤•à¥‹ 'à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾' à¤µà¤¸à¥à¤¤à¥à¤•à¥‹ à¤†à¤¨à¥à¤¤à¤°à¤¿à¤• à¤—à¥à¤£à¤¹à¤°à¥‚ à¤¨à¤¿à¤®à¥à¤¨à¤¾à¤¨à¥à¤¸à¤¾à¤° à¤›à¤¨à¥:

state - initially pending, then changes to either fulfill upon resolve or rejected when reject is called (à¤¸à¥à¤°à¥à¤®à¤¾ 'à¤ªà¥‡à¤¨à¥à¤¡à¤¿à¤™', à¤¤à¥à¤¯à¤¸à¤ªà¤›à¤¿ à¤¸à¤®à¤¾à¤§à¤¾à¤¨à¤®à¤¾ 'à¤ªà¥‚à¤°à¤¾' à¤µà¤¾ 'à¤…à¤¸à¥à¤µà¥€à¤•à¤¾à¤°' à¤—à¤°à¥à¤¦à¤¾ 'à¤…à¤¸à¥à¤µà¥€à¤•à¥ƒà¤¤' à¤®à¤¾ à¤ªà¤°à¤¿à¤µà¤°à¥à¤¤à¤¨ à¤¹à¥à¤¨à¥à¤›)

