Promise with resolve and reject callbacks


à¤à¤• à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤—à¥à¤£à¤¹à¤°à¥‚ à¤ªà¤¹à¥à¤à¤š à¤—à¤°à¥à¤¨ à¤¸à¤•à¥à¤¦à¥ˆà¤¨: à¤¸à¥à¤Ÿà¥‡à¤Ÿ à¤° à¤ªà¤°à¤¿à¤£à¤¾à¤®à¥¤ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾à¤¹à¤°à¥‚ à¤¸à¤®à¥à¤¹à¤¾à¤²à¥à¤¨ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤µà¤¿à¤§à¤¿à¤¹à¤°à¥‚ à¤†à¤µà¤¶à¥à¤¯à¤• à¤›à¤¨à¥à¥¤

Example of a promise.
à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤•à¥‹ à¤‰à¤¦à¤¾à¤¹à¤°à¤£à¥¤
let promiseOne = new Promise(function(resolve, reject) {
