  setTimeout(() => resolve("done"), 1000);
})

let promiseTwo = new Promise(function(resolve, reject) {
  // the function is executed automatically when the promise is constructed

  // after 1-second signal that the job is done with the result "error"
  setTimeout(() => reject(new Error("Whoops!")), 1000);
})

Here, the promiseOne is an example of a "fulfilled promise" as it successfully resolves the values, whereas the promiseTwo is a "rejected promise" as it gets rejected. A promise that is either rejected or resolved is called a settled promise, as opposed to an initially pending promise. Consuming function from the promise can be registered using the .then and .catch methods. We can also add .finally method for performing cleanup or finalizing after previous methods have been completed.
à¤¯à¤¹à¤¾à¤, promiseOne à¤à¤• "fulfilled promise" à¤•à¥‹ à¤à¤• à¤‰à¤¦à¤¾à¤¹à¤°à¤£ à¤¹à¥‹ à¤•à¤¿à¤¨à¤•à¤¿ à¤¯à¤¸à¤²à¥‡ à¤¸à¤«à¤²à¤¤à¤¾à¤ªà¥‚à¤°à¥à¤µà¤• à¤®à¤¾à¤¨à¤¹à¤°à¥‚ à¤¸à¤®à¤¾à¤§à¤¾à¤¨ à¤—à¤°à¥à¤¦à¤›, à¤œà¤¬à¤•à¤¿ promiseTwo à¤à¤• "rejected promise" à¤¹à¥‹ à¤•à¤¿à¤¨à¤•à¤¿ à¤¯à¥‹ à¤…à¤¸à¥à¤µà¥€à¤•à¤¾à¤° à¤¹à¥à¤¨à¥à¤›à¥¤ à¤…à¤¸à¥à¤µà¥€à¤•à¥ƒà¤¤ à¤µà¤¾ à¤¸à¤®à¤¾à¤§à¤¾à¤¨ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾à¤²à¤¾à¤ˆ à¤¸à¥à¤°à¥à¤®à¤¾ à¤ªà¥‡à¤¨à¥à¤¡à¤¿à¤™ à¤—à¤°à¤¿à¤à¤•à¥‹ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾à¤•à¥‹ à¤µà¤¿à¤ªà¤°à¥€à¤¤ à¤¸à¥‡à¤Ÿà¤² à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾ à¤­à¤¨à¤¿à¤¨à¥à¤›à¥¤ à¤ªà¥à¤°à¤¤à¤¿à¤œà¥à¤žà¤¾à¤¬à¤¾à¤Ÿ à¤ªà¥à¤°à¤•à¤¾à¤°à¥à¤¯ à¤‰à¤ªà¤­à¥‹à¤— à¤—à¤°à¥à¤¦à¤¾ .then à¤° .catch à¤µà¤¿à¤§à¤¿à¤¹à¤°à¥‚ à¤ªà¥à¤°à¤¯à¥‹à¤— à¤—à¤°à¥‡à¤° à¤¦à¤°à¥à¤¤à¤¾ à¤—à¤°à¥à¤¨ à¤¸à¤•à¤¿à¤¨à¥à¤›à¥¤ à¤¹à¤¾à¤®à¥€ à¤ªà¤¹à¤¿à¤²à¥‡à¤•à¤¾ à¤µà¤¿à¤§à¤¿à¤¹à¤°à¥‚ à¤ªà¥‚à¤°à¤¾ à¤­à¤à¤ªà¤›à¤¿ à¤¸à¤«à¤¾à¤ˆ à¤µà¤¾ à¤…à¤¨à¥à¤¤à¤¿à¤® à¤°à¥‚à¤ª à¤¦à¤¿à¤¨à¤•à¤¾ à¤²à¤¾à¤—à¤¿ .finally à¤µà¤¿à¤§à¤¿ à¤ªà¤¨à¤¿ à¤¥à¤ªà¥à¤¨ à¤¸à¤•à¥à¤›à¥Œà¤‚à¥¤
let promiseOne = new Promise(function(resolve, reject) {
  setTimeout(() => resolve("done!"), 1000);
});

// resolve runs the first function in .then
promiseOne.then(
  result => alert(result), // shows "done!" after 1 second
  error => alert(error) // doesn't run
);

let promiseTwo = new Promise(function(resolve, reject) {
  setTimeout(() => reject(new Error("Whoops!")), 1000);
});

// reject runs the second function in .then
promiseTwo.then(
  result => alert(result), // doesn't run
  error => alert(error) // shows "Error: Whoops!" after 1 second
);

let promiseThree = new Promise((resolve, reject) => {
  setTimeout(() => reject(new Error("Whoops!")), 1000);
});

// .catch(f) is the same as promise.then(null, f)
promiseThree.catch(alert); // shows "Error: Whoops!" after 1 second

